INSERT INTO `wp_postmeta` VALUES (2808, 210, 'content', '<b>5  CHIC XE A HNH U TIN TRN TH GII</b>\r\n\r\n<i><span style=\"font-weight: 400;\">Yamaha DT-1 : chic xe a hnh hn hp u tin trn th gii</span></i>\r\n\r\n<img class=\"alignnone size-full\" src=\"https://static1.hotcarsimages.com/wordpress/wp-content/uploads/2018/07/2a23557d2358e1d3eb6e36f2200e7619.jpg\" width=\"1600\" height=\"1075\" />\r\n\r\n<span style=\"font-weight: 400;\">Yamaha DT-1 l mt trong nhng d n tin phong v to nn v th ca Yamaha trn ton cu. DT-1 c gii thiu nm 1968 v l mu xe a hnh hn hp u tin trn th gii vo thi im . Chic xe c thit k cho c mc ch s dng c ng nha v off-road. Hn 12,000 xe  c bn ra ch trong nm u tin v l mt trong nhng chic xe bn chy nht ti th trng M.</span>\r\n\r\n<b>4  S HU CNG NGH CH TO MY BAY</b>\r\n\r\n<i><span style=\"font-weight: 400;\">Yamaha  thnh thc ng dng cng ngh ch to my bay</span></i>\r\n\r\n<img class=\"alignnone size-full\" src=\"https://static1.hotcarsimages.com/wordpress/wp-content/uploads/2018/07/65b70279b3e9ca1be9f7255a7d698ab8.jpg\" width=\"2736\" height=\"1824\" />\r\n\r\n<span style=\"font-weight: 400;\">Nhiu cng ngh ca Yamaha  c ng dng trong sn xut thi th chin th hai, tiu biu nh k thut c c ng dng vo sn xut ng c v ch to cnh qut my bay. Ch tch th 4 ca tp on Yamaha, ngi Genichi Kawakami  s dng tim nng ny ca tp on  th nghim sn xut cc sn phm mi. Lc u, ng d nh s sn xut my khu hay ph tng xe my, xe  t. ng cn ch thn n M vi ln  nghin cu sn xut, v cui cng, nhng chic xe my  c to ra.</span>\r\n\r\n<b>3  BIU TNG LOGO YAMAHA</b>\r\n\r\n<span style=\"font-weight: 400;\"><img class=\"alignnone size-full\" src=\"https://static1.hotcarsimages.com/wordpress/wp-content/uploads/2018/07/speedbloch_009.jpg\" width=\"1440\" height=\"1080\" /></span>\r\n\r\n<span style=\"font-weight: 400;\">Logo Yamaha c to thnh t ba chic m thoa an xen vo nhau, gi nhc n tp on Yamaha chuyn sn xut dng c m nhc, cng chnh l tin thn ca cng ty Yamaha Motor. Ba chic m thoa tng trng cho Cng ngh, Sn xut v Bn hng. Vi s hin din ton cu ngy nay, Yamaha s hu mt trong nhng logo d nhn bit nht th gii.</span>\r\n\r\n<b>2 - YAMAHA MOTOR THNH LP NM 1955</b>\r\n\r\n<i><span style=\"font-weight: 400;\">Yamaha Motor c thnh lp vo nm 1955</span></i>\r\n\r\n<img class=\"alignnone size-full\" src=\"https://global.yamaha-motor.com/stories/history/stories/img/0001/pic_002.jpg\" width=\"566\" height=\"353\" />\r\n\r\n<span style=\"font-weight: 400;\">Tp on Yamaha  tin hnh nghin cu sn xut ng c xe my t nm 1954. Sau khi mu xe YA-1 c hon thin nm 1955, b phn ch to ng c ca tp on Yamaha  chnh thc tch ra v thnh lp cng ty Yamaha Motor. Yamaha Motor vn thuc s hu a s ca Tp on Yamaha vi t l s hu xp x 10%.</span>\r\n\r\n<b>1  TIN THN L TP ON SN XUT DNG C M NHC</b>\r\n\r\n<i><span style=\"font-weight: 400;\">Yamaha Motor c tin thn l cng ty sn xut nhc c</span></i>\r\n\r\n<img class=\"alignnone size-full\" src=\"https://static1.hotcarsimages.com/wordpress/wp-content/uploads/2018/07/used-yamaha-m500-upright2.jpg\" width=\"1200\" height=\"900\" />\r\n\r\n<span style=\"font-weight: 400;\">Tp on Yamaha ngy nay c tin thn l cng ty Nippon Gakki c thnh lp nm 1887, chuyn ch tc n piano v organ. Qua hn 130 nm pht trin, tp on Yamaha l nh sn xut n v dng c m nhc ln nht th gii hin nay. Nhng cm hng t m nhc  lm nn nhiu c trng trong thit k v vn hnh ca nhng chic xe mang thng hiu Yamaha.</span>\r\n\r\n<span style=\"font-weight: 400;\">Ref: https://www.hotcars.com/20-facts-americans-should-know-about-yamaha-motorcycles/</span>');
