INSERT INTO `wp_postmeta` VALUES (9981, 609, 'short_description', 'Yamaha Motor uc thnh lp t nhng nm 50 ca th k trc vi tin thn l tp on Yamaha. Hn 60 nm khng ngng pht trin v sng to ca cng ty   li nhiu im th v.\r\n\r\n<picture><source srcset=\"https://yamaha-motor.com.vn/wp/wp-content/webp-express/webp-images/doc-root/wp/wp-content/uploads/2021/09/image_viber_2021-09-22_16-01-06-242.jpg.webp 1334w, https://yamaha-motor.com.vn/wp/wp-content/webp-express/webp-images/doc-root/wp/wp-content/uploads/2021/09/image_viber_2021-09-22_16-01-06-242-150x84.jpg.webp 150w, https://yamaha-motor.com.vn/wp/wp-content/webp-express/webp-images/doc-root/wp/wp-content/uploads/2021/09/image_viber_2021-09-22_16-01-06-242-300x169.jpg.webp 300w, https://yamaha-motor.com.vn/wp/wp-content/webp-express/webp-images/doc-root/wp/wp-content/uploads/2021/09/image_viber_2021-09-22_16-01-06-242-768x432.jpg.webp 768w, https://yamaha-motor.com.vn/wp/wp-content/webp-express/webp-images/doc-root/wp/wp-content/uploads/2021/09/image_viber_2021-09-22_16-01-06-242-1024x576.jpg.webp 1024w\" type=\"image/webp\" sizes=\"(max-width: 1334px) 100vw, 1334px\" data-srcset=\"https://yamaha-motor.com.vn/wp/wp-content/webp-express/webp-images/doc-root/wp/wp-content/uploads/2021/09/image_viber_2021-09-22_16-01-06-242.jpg.webp 1334w, https://yamaha-motor.com.vn/wp/wp-content/webp-express/webp-images/doc-root/wp/wp-content/uploads/2021/09/image_viber_2021-09-22_16-01-06-242-150x84.jpg.webp 150w, https://yamaha-motor.com.vn/wp/wp-content/webp-express/webp-images/doc-root/wp/wp-content/uploads/2021/09/image_viber_2021-09-22_16-01-06-242-300x169.jpg.webp 300w, https://yamaha-motor.com.vn/wp/wp-content/webp-express/webp-images/doc-root/wp/wp-content/uploads/2021/09/image_viber_2021-09-22_16-01-06-242-768x432.jpg.webp 768w, https://yamaha-motor.com.vn/wp/wp-content/webp-express/webp-images/doc-root/wp/wp-content/uploads/2021/09/image_viber_2021-09-22_16-01-06-242-1024x576.jpg.webp 1024w\" /></picture>');
INSERT INTO `wp_postmeta` VALUES (9982, 609, '_short_description', 'field_611277f24c36b');
INSERT INTO `wp_postmeta` VALUES (9983, 609, 'content', '<img class=\"alignnone\" src=\"https://static1.hotcarsimages.com/wordpress/wp-content/uploads/2018/07/yamaha2.jpg\" alt=\"\" width=\"1200\" height=\"628\" />\r\n\r\n<span style=\"font-weight: 400;\">Cng ty Yamaha Motor hin c gn 53,000 nhn s trn ton cu vi hn 130 cng ty thnh vin v 28 cng ty con tri di khp th gii. Yamaha hin nay ang l mt trong nhng cng ty dn u ton th gii khng ch v v sn xut xe my, m t, ng c m cn  lnh vc thit b hng hi v cc loi trc thng, my mc cng nghip khc. Sau y l 20 iu t ai bit v cng ty.</span>\r\n\r\n<b>10  HN 60 NM THI U TC </b>\r\n\r\n<span style=\"font-weight: 400;\">Yamaha c bit n vi thnh tch vang di ti nhiu gii ua xe quc t. Nhng tay ua huyn thoi nh Giacomo Agostini, Kenny Roberts, Bob Hannah, Valentino Rossi, Maverick Vinales vi nhiu k lc v ch th gii  khp cc gii u t MotoGP, MXGP, Paris Dakar hay Endurance,  lm nn truyn thng y t ho hn 60 nm qua cho Yamaha. Yamaha cn nhiu ln vinh d nhn danh hiu Nh sn xut ng c ca nm ti cc cuc ua.</span>\r\n\r\n<b>9  YAMAHA C SIU XE NG C V12</b>\r\n\r\n<i><span style=\"font-weight: 400;\">Siu xe OX99-11 ng c V12 ca Yamaha</span></i>\r\n\r\n<img class=\"alignnone size-full\" src=\"https://static1.hotcarsimages.com/wordpress/wp-content/uploads/2018/07/p1-55f6e0949e500-55f844bbd1045.jpg\" width=\"1200\" height=\"700\" />\r\n\r\n<span style=\"font-weight: 400;\">Yamaha hc hi t kinh nghim cung ng cho i ua F1 v sn xut chic siu xe u tin ca mnh vo nm 1992. Xe c trang b ng c 3.5L OX99 V12 sn sinh cng sut 400 m lc ti vng tua 10,000 vng/pht, i cng hp s tay 6 cp v trng lng ch 1,150kg. Nguyn mu chic xe c thit k bi Takuya Yura. D n OX99-11 ngng lai vo nm 1994 khi khng em li trin vng thng mi ha.</span>\r\n\r\n<b>8  SN XUT NG C CHO FORD V VOLVO</b>\r\n\r\n<i><span style=\"font-weight: 400;\">ng c SHO c Yamaha sn xut</span></i>\r\n\r\n<img class=\"alignnone size-full\" src=\"https://static1.hotcarsimages.com/wordpress/wp-content/uploads/2018/07/2.-1989-ford-taurus-sho-30-liter-v-6-engine-photo-568183-s-original.jpg\" width=\"2250\" height=\"1375\" />\r\n\r\n<span style=\"font-weight: 400;\">Yamaha Motor khng ch tp trung vo sn xut xe m t. Vo nm 1967 khi chic Toyota 2000GT c sn xut, Yamaha Motor  tip tc u t v pht trin dy chuyn sn xut. Nm 1984, cng ty sn xut ng c V6 c s dng trn cc i Ford Taurus SHO 1989-1995. Volvo hay Noble cng  ng dng v sn xut ng c da trn nhng nghin cu ca Yamaha.</span>\r\n\r\n<b>7 - YAMAHA C QUAN H THN THIT VI TOYOTA</b>\r\n\r\n<i><span style=\"font-weight: 400;\">Mu xe 2000 GT do Yamaha cng pht trin vi Toyota</span></i>\r\n\r\n<img class=\"alignnone size-full\" src=\"https://static1.hotcarsimages.com/wordpress/wp-content/uploads/2018/07/toyota-2000gt-2.jpg\" width=\"1024\" height=\"768\" />\r\n\r\n<span style=\"font-weight: 400;\">Toyota s hu 5% c phn ca Yamaha Motor v hai bn cng hp tc trong cc lnh vc chung nh pht trin ng c xe, xe ua v ng c hng hi. S hp tc gia Yamaha v Toyota  em n cho th trng nhiu ng c ci tin cng nh nhiu li nhun hn cho c hai cng ty, tiu biu l chic xe Toyota 2000GT. Chic xe c ra mt vo nm 1965 ti trin lm Tokyo Motor Show, vi thit k 2 ca, trang b ng c 6 xy lanh thng hng dung tch 2.3L cho cng sut ln n 150 m lc, truyn ng qua hp s tay 5 cp. C 351 chic Toyota 2000 GT  c bn ra trc khi dng sn xut vo nm 1970.</span>\r\n\r\n<b>6 - YAMAHA C BN RA TI M VO NM 1958</b>\r\n\r\n<i><span style=\"font-weight: 400;\">YA-1: Chic xe thng mi u tin ca Yamaha</span></i>\r\n\r\n<img class=\"alignnone size-full\" src=\"https://static1.hotcarsimages.com/wordpress/wp-content/uploads/2018/07/1200px-YAMAHA_YA-1_Yamaha_Communication_Plaza.jpg\" width=\"1200\" height=\"900\" />\r\n\r\n<span style=\"font-weight: 400;\">Chic xe YA-1 vi bit danh Chun chun  l mu xe u tin ca Yamaha. Chic xe c ra mt nm 1955 v nhanh chng dnh c s yu thch ca ngi dn Nht Bn. Cha y ba nm sau, YA-1  c mt ti th trng M thng qua nh phn phi Cooper Motors. Hin nay, Yamaha l cng ty c sn lng xe my bn ra ng th 3 ti th trng M.</span>\r\n\r\n<span style=\"font-weight: 400;\">Ref: https://www.hotcars.com/20-facts-americans-should-know-about-yamaha-motorcycles/</span>');
