INSERT INTO `wp_postmeta` VALUES (10001, 611, 'short_description', '<div dir=\"auto\"><em><strong>Francesco Bagnaia  rt ngn khong cch vi Fabio Quartararo  v tr u bng xp hng MotoGP 2021 sau khi v ch San Marino MotoGP 2021 ti Misano Circuit, Ch nht (19/9). Chng 14 c nh gi l mt chng ua khc lit cho n vng ua cui cng khi tay ua Bagnaia ln quyt tm cao   thu hp khong cch vi tay ua Yamaha.</strong></em></div>');
INSERT INTO `wp_postmeta` VALUES (10002, 611, '_short_description', 'field_611277f24c36b');
INSERT INTO `wp_postmeta` VALUES (10003, 611, 'content', '<div dir=\"auto\">Quartararo ang ng u bng xp hng MotoGP 2021 vi 234 im. Tay ua ca Yamaha hn Bagnaia 48 im,  v tr th hai vi 186 im.</div>\r\n<div dir=\"auto\"><a href=\"https://yamaha-dev.demo-web.asia/wp/wp-content/uploads/2021/10/MEYMm__TIX7720.jpg.webp\"><img class=\"alignnone size-medium wp-image-613\" src=\"https://yamaha-dev.demo-web.asia/wp/wp-content/uploads/2021/10/MEYMm__TIX7720.jpg-300x200.webp\" alt=\"\" width=\"300\" height=\"200\" /></a></div>\r\n<div dir=\"auto\">\r\n<div dir=\"auto\">Franco Morbidelli, tr li sau cuc phu thut u gi  ra mt ti Monster Yamaha vi t cch l ngi thay th ton thi gian cho Vinales, v ch th 18  ch sau ngi ng hng  ng i c ca Petronas Yamaha, Valentino Rossi.</div>\r\n<div dir=\"auto\"><a href=\"https://yamaha-dev.demo-web.asia/wp/wp-content/uploads/2021/10/241379917_4337379762981716_2257110053817652685_n.jpg.webp\"><img class=\"alignnone size-medium wp-image-614\" src=\"https://yamaha-dev.demo-web.asia/wp/wp-content/uploads/2021/10/241379917_4337379762981716_2257110053817652685_n.jpg-225x300.webp\" alt=\"\" width=\"225\" height=\"300\" /></a></div>\r\n<div dir=\"auto\">\r\n<div class=\"news-detail\">\r\n<div class=\"news-detail__content newsDetail\">\r\n<div class=\"post_content\">\r\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\r\n<div dir=\"auto\">Tip qun chic chin m ca ca Morbidelli l Andrea Dovizioso, ngi v nh 3 danh hiu MotoGP,  cn ch chng 14  v tr th 21.</div>\r\n</div>\r\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\r\n<div dir=\"auto\">Cng Yamaha Motor Vit Nam lin tc cp nht nhng tin tc mi nht v MotoGP 2021 nh!</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>');
