INSERT INTO `wp_postmeta` VALUES (10021, 615, 'short_description', '<div dir=\"auto\"><em><strong>Gim c iu hnh ca Yamaha Motor Racing  Lin Jarvis v cng ho hng cho n 2 tay ua ngi  l Franco Morbidelli v Andrea Dovizioso v vi i ca mnh, trong : Morbidelli s gia nhp Monster Energy Yamaha t 2021  2023 v Dovizioso tr thnh tay ua Petronas Yamaha SRT t 2021  2022.</strong></em></div>');
INSERT INTO `wp_postmeta` VALUES (10022, 615, '_short_description', 'field_611277f24c36b');
INSERT INTO `wp_postmeta` VALUES (10023, 615, 'content', '<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\r\n<div dir=\"auto\">Yamaha Motor Co., Ltd vui mng thng bo Franco Morbidelli  k hp ng vi i ua MotoGP ca Yamaha Factory Racing cho 5 chng ua cn li vo nm 2021 v cho cc ma gii 2022 v 2023. Tay ua ngi  s tr li sau chn thng vo cui tun ny, ra mt vi i ua Monster Energy Yamaha MotoGP ti Gran Premio di San Marino e della Riviera di Rimini.</div>\r\n<div dir=\"auto\"></div>\r\n</div>\r\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\r\n<div dir=\"auto\">Cho n nay, Morbidelli  th hin kh nng kim sot tay li iu luyn trong ba ma gii ua cng Yamaha ti Gii v ch th gii MotoGP. S hp tc thnh cng ny  dn n v tr th hai chung cuc cho Morbidelli vo nm 2020 v  ginh c nm ln ng trn bc vinh quang.</div>\r\n<div dir=\"auto\"></div>\r\n</div>\r\n<div dir=\"auto\"><a href=\"https://yamaha-dev.demo-web.asia/wp/wp-content/uploads/2021/10/241388946_4329939150392444_2768492753263570668_n.jpg.webp\"><img class=\"aligncenter wp-image-617 size-full\" src=\"https://yamaha-dev.demo-web.asia/wp/wp-content/uploads/2021/10/241388946_4329939150392444_2768492753263570668_n.jpg.webp\" alt=\"\" width=\"1242\" height=\"813\" /></a></div>\r\n<div dir=\"auto\"></div>\r\n<div dir=\"auto\">\r\n<div dir=\"auto\">Franky s nhn c ton b s hu thun ca Yamaha Motor Company. Chng ti cm thy chc chn rng: mt tay ua lnh ngh, im tnh v giu kinh nghim nh Franky s tip thm sc mnh cho i ua MotoGP Yamaha Factory Racing v s gt hi c nhiu thnh cng trong tng lai Gim c iu hnh ca Yamaha Motor Racing  Lin Jarvis cho bit.</div>\r\n<div dir=\"auto\"></div>\r\n<div dir=\"auto\">Vi s ra mt ca Franco Morbidelli trong i Monster Energy Yamaha MotoGP, Yamaha cng ng thi cho dn ngi sao MotoGP Andrea Dovizioso v vi i ua PETRONAS Yamaha Sepang Racing Team. Tay ua ngi  s ua cho i v tinh ca Yamaha trong thi gian cn li ca nm 2021 cng nh ton b ma gii MotoGP 2022.</div>\r\n<div dir=\"auto\"></div>\r\n</div>\r\n<div dir=\"auto\"><a href=\"https://yamaha-dev.demo-web.asia/wp/wp-content/uploads/2021/10/yfr_editorial_use_pictures_201343386613.jpg.webp\"><img class=\"alignnone wp-image-618 size-full\" src=\"https://yamaha-dev.demo-web.asia/wp/wp-content/uploads/2021/10/yfr_editorial_use_pictures_201343386613.jpg.webp\" alt=\"\" width=\"2560\" height=\"1668\" /></a></div>\r\n<div dir=\"auto\"></div>\r\n<div dir=\"auto\">\r\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\r\n<div dir=\"auto\">Yamaha cng nh nhng ngi hm m MotoGP trn ton th gii ang ho hc ch i s tr li ca Dovizioso trn chic Yamaha YZR-M1 vo cui tun ny. Tay ua 35 tui s bt u chng th hai trong s nghip ua xe ca mnh vi Yamaha trn chin m c ca Morbidelli. Trong ma gii nm 2022, anh y s li chic YZR-M1 theo thng s ca nh my v nhn c s h tr y  t Yamaha Motor Co., Ltd.</div>\r\n<div dir=\"auto\"></div>\r\n</div>\r\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\r\n<div dir=\"auto\">Cng c v 2 tay ua ngi  trong chng ua sp ti ti Gran Premio di San Marino e della Riviera di Rimini nh!</div>\r\n</div>\r\n</div>');
