INSERT INTO `wp_postmeta` VALUES (25651, 992, 'content', 'Lets face it, when you jump on your bike, the last thing you want to think about is the cost of maintaining it. Thats why we sit down with you and work out how you intend to use your bike, and the amount of mileage you expect to cover.\r\n\r\nThe Service Package will be live for 27 months from the date of purchasing.\r\n\r\n<strong>ITEMS:</strong>\r\n<ol>\r\n 	<li>Lubricate &amp; adjust free play on drive chain</li>\r\n 	<li>Brake/Clutch fluid level inspection</li>\r\n 	<li>Tyre tread depth inspection</li>\r\n 	<li>Tyre pressure check</li>\r\n 	<li>Wheel bearing play inspection</li>\r\n 	<li>Wheel rim condition inspection</li>\r\n 	<li>Drive chain and sprockets inspection</li>\r\n 	<li>Wheel alignment inspection</li>\r\n 	<li>Brake light operation</li>\r\n 	<li>Front brake visual inspection</li>\r\n 	<li>Rear brake visual inspection</li>\r\n 	<li>Brake free play inspection</li>\r\n 	<li>Head stock bearings inspect and adjust</li>\r\n 	<li>Swingarm play inspection</li>\r\n 	<li>Visual fluid leak inspection</li>\r\n 	<li>Front fork inspection</li>\r\n</ol>\r\n<strong>NOTES:</strong>\r\n<p class=\"fs16\">Wear and tear items such as brake pads and discs, chain and sprockets, etc, are not covered by the Service Plan and an additional cost will be incurred should they require replacement.</p>');
