INSERT INTO `wp_postmeta` VALUES (29013, 494, 'content', '<h2 class=\"title\">Chnh sch Quyn Ring t ca Yamaha Motor Vit Nam</h2>\r\nCng ty TNHH Yamaha Motor Vit Nam (Sau y gi tt l YMVN) cam kt thu thp, qun l cc thng tin c nhn thu thp c t hot ng kinh doanh ca mnh mt cch ng n theo quy nh php lut. Chng ti m bo tt c cn b lm vic ti mi b phn ca YMVN u hiu c tm quan trng ca vic bo mt thng tin c nhn v c xy dng c ch bo v thng tin c nhn. Ngoi ra, bng cch a ra cc quy nh qun l v vic thu thp, s dng, v cung cp thng tin c nhn, chng ti qun l thng tin c nhn theo ng quy nh v lun n lc khng ngng ci thin cc quy nh ny. Cn c Php lut an ton thng tin mng v Php lut bo v quyn li ngi tiu dng, YMVN cng khai cc ni dung sau v vic bo v thng tin c nhn (sau y gi l Thng tin) ti doanh nghip ca chng ti nh sau:\r\n<h4 class=\"title-sm\">Mc ch thu thp thng tin c nhn.</h4>\r\nChng ti s s dng cc Thng tin thu thp c cho cc mc ch sau:\r\n<ul>\r\n 	<li>Gi ti Khch hng cc thng tin lin quan cc sn phm/dch v m chng ti cung cp bao gm nhng khng gii hn: Cc chng trnh khuyn mi, u i; ha n in t; th cm n, v.v. khi c Khch hng ng .</li>\r\n 	<li>Lp k hoch sn xut, kinh doanh; kho st th trng; trin khai d n mi; xem xt, p dng cc bin php ci thin cht lng sn phm, dch v; nh gi mc  hi lng/nhu cu/th hiu ca Khch hng cng nh nh gi cht lng sn phm v dch v hin ti ca YMVN, v.v., v xy dng bng cu hi kho st  t c nhng mc tiu ny.</li>\r\n 	<li>Tin hnh cc cng vic cn thit  phn hi cc yu cu,  ngh, phn nn, phn nh, khiu ni, khiu kin t pha Khch hng v  cung cp hng ha v dch v mt cch nhanh chng v tt nht.</li>\r\n 	<li>Phn hi bt k thng bo, hng dn,  ngh hoc yu cu iu tra no t bt k c quan nh nc c thm quyn no.</li>\r\n 	<li>Cc mc ch s dng khc c quy nh r ti tng thi im thu thp thng tin c nhn (nu c).</li>\r\n</ul>\r\nCho cc mc ch trn, chng ti c th s cung cp Thng tin cho cc i l, i tc, nh thu, nh u t ca YMVN (sau y gi l i tc). Chng ti lun yu cu i tc s dng, lu tr v bo mt Thng tin theo ng quy nh ca php lut cng nh chng ti s chuyn giao v qun l Thng tin mt cch cn trng.\r\n<h4 class=\"title-sm\">Phm vi thu thp Thng tin</h4>\r\n<div class=\"collapse-item\">\r\n<div class=\"content\">\r\n\r\nCc Thng tin c thu thp bao gm nhng khng gii hn: a ch ni c tr, h tn, gii tnh, ngy sinh, thng tin lin h (s in thoi, email, v.v.), thng tin sn phm v chi tit ni dung t vn vi khch hng.\r\n\r\ni tng Khch hng c thu thp Thng tin gm:\r\n<ul>\r\n 	<li>Khch hng ng k mua cc sn phm v s dng dch v mang thng hiu Yamaha (xe my, xe gn my, xe p in, sn phm ng thy bao gm tu, thuyn bum, thy phi c v phng tin thy gn ng c, v b bi, v.v).</li>\r\n 	<li>Khch hng yu cu sa cha sn phm.</li>\r\n 	<li>Khch hng ng k cc dch v thnh vin.</li>\r\n 	<li>Khch hng yu cu nhn ti liu bao gm c sch gii thiu sn phm.</li>\r\n 	<li>Khch hng lin h quy thng tin.</li>\r\n 	<li>Khch hng tr li kho st.</li>\r\n 	<li>Khch hng tham gia vo bt k s kin/chin dch kinh doanh no ca YMVN hoc do YMVN thc hin.</li>\r\n 	<li>Khch hng tham gia bt k chuyn thm quan nh xng no.</li>\r\n 	<li>Nhng ngi lin quan n bt k tai nn no c lin quan n sn phm ca chng ti.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class=\"collapse-item\">\r\n<h4 class=\"title-sm\">Phm vi s dng Thng tin.</h4>\r\n<div class=\"content\">\r\n\r\nCc thng tin ca Khch hng thu thp c  s dng cho mc ch c nu ti mc 1 ca Chnh sch ny. Bn cnh , cc Thng tin s c s dng trong phm vi ni b ca YMVN v i tc ca YMVN.\r\n\r\n</div>\r\n</div>\r\n<div class=\"collapse-item\">\r\n<h4 class=\"title-sm\">Thi gian lu tr thng tin</h4>\r\n<div class=\"content\">\r\n\r\nYMVN ch lu gi v s dng Thng tin phc v cho mc ch m Thng tin c thu thp. Thng tin s c lu tr trong mt khong thi gian cn thit  t c mc ch  v s c lp tc xa b khi thng tin khng cn cn thit.\r\n\r\n</div>\r\n</div>\r\n<div class=\"collapse-item\">\r\n<h4 class=\"title-sm\">i tng tip cn thng tin</h4>\r\n<div class=\"content\">\r\n\r\ni tng tip cn Thng tin bao gm:\r\n<ul>\r\n 	<li>Cc c nhn, phng, ban b phn ca YMVN.</li>\r\n 	<li>Cc c nhn, phng, ban b phn ca i tc thc hin dch v theo yu cu ca YMVN.</li>\r\n 	<li>Cc cng ty thuc Tp on Yamaha (di s kim sot ca Cng ty Yamaha Motor Co., Ltd ti Nht Bn) u c th ng s dng cc Thng tin.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class=\"collapse-item\">\r\n<h4 class=\"title-sm\">Thng tin, phng thc lin h</h4>\r\n<div class=\"content\">\r\n<p class=\"text-uppercase\">CNG TY TNHH YAMAHA MOTOR VIT NAM</p>\r\n\r\n<ul>\r\n 	<li>Tr s chnh: Thn Bnh An, X Trung Gi, Huyn Sc Sn, TP. H Ni.</li>\r\n 	<li>Hotline (min ph):<a href=\"http://demo/terms-of-use/#\">18001588</a></li>\r\n 	<li><a class=\"color-blue\" href=\"http://demo/terms-of-use/#\">Website www.yamaha-motor.com.vn</a></li>\r\n</ul>\r\nNu bn c bt k cu hi no lin quan n chnh sch quyn ring t ca chng ti, vui lng lin h vi Nhn vin Chm sc khch hng ca Yamaha theo s 18001588 hoc<a class=\"color-blue\" href=\"http://demo/terms-of-use/#\">cskh@yamaha-motor.com.vn</a>\r\n\r\n</div>\r\n</div>\r\n<div class=\"collapse-item\">\r\n<h4 class=\"title-sm\">Phng thc tip cn v iu chnh Thng tin ca Khch hng</h4>\r\n<div class=\"content\">\r\n<ul>\r\n 	<li>Khi thu thp Thng tin, YMVN lun cng khai mc ch thu thp, s dng v  nghc s dng Thng tin ng mc ch  v c cam kt bo mt Thng tin ca khch hng.</li>\r\n 	<li>Khch hng c quyn truy cp vo d liu Thng tin ca mnh, yu cu iu chnh li nhng sai st trong d liu c nhn ca mnh hoc cp nht, b sung  hon thin Thng tin c lu tr trn website bng cch lin h YMVN ti Mc 6.</li>\r\n 	<li>Khch hng cng c quyn yu cu YMVN ngng s dng d liu c nhn cho mc ch tip th.</li>\r\n 	<li>YMVN s phn hi ngay sau khi nhn c yu cu sa i hoc chm dt s dng Thng tin.</li>\r\n 	<li> thc hin cc quyn trn, vui lng lin h theo thng tin c quy nh ti Mc 6 nu trn  c chng ti h tr.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class=\"collapse-item\">\r\n<h4 class=\"title-sm\">Cam kt khc</h4>\r\n<ul>\r\n 	<li>YMVN tin hnh cc bin php bo mt ph hp  phng nga cc ri ro nh truy cp tri php v mt, ph hy, gi mo v r r thng tin c nhn. YMVN xy dng v p dng cht ch quy nh qun l thng tin i vi ton b c nhn, phng, ban, b phn, chi nhnh ca cng ty.</li>\r\n 	<li>YMVN tp trung vo cc hot ng nng cao nhn thc ca ton b ngi lao ng, c bit nhng c nhn chu trch nhim x l thng tin bao gm vic tin hnh tp hun/o to nh k v vic bo mt thng tin c nhn.</li>\r\n 	<li>YMVN lun k kt tha thun bo mt thng tin vi ngi lao ng v i tc ca YMVN.</li>\r\n 	<li>Ngoi tr cc i tng thng tin nu ti Mc 5 bn trn, YMVN khng cung cp Thng tin cho bt k bn th ba no m khng c s ng  ca khch hng.</li>\r\n 	<li>Nu bt k s c no v d nh r r thng tin c nhn xy ra, chng ti s x l ph hp bng cch iu tra tt c cc thng tin v nguyn nhn, ng thi c cc bin php  ngn chn thit hi dy chuyn v ti din. Ngoi cc vn  trn, mi ngi lao ng v b phn ca YMVN s phi tun th theo cc quy nh v php lut lin quan n bo mt thng tin c nhn ca khch hng.</li>\r\n 	<li>YMVN cam kt m bo tnh chnh xc, hon thin, v cp nht kp thi cc Thng tin trong qu trnh thu thp, s dng v chuyn giao cc Thng tin .</li>\r\n</ul>\r\n</div>');
