INSERT INTO `wp_postmeta` VALUES (29019, 496, 'content', '<b>IU KHON S DNG</b>\r\n<ol>\r\n 	<li><span style=\"font-weight: 400;\"> iu Khon S Dng Website</span></li>\r\n</ol>\r\n<span style=\"font-weight: 400;\">1.Gii thiu</span>\r\n\r\n<span style=\"font-weight: 400;\">1.1. Cho mng bn n vi (\"Website\"). Chng ti cung cp thng tin cho bn (Bn hoc Ngi Dng) trn Website theo cc iu khon v iu kin ti vn bn ny. Bng cch truy cp, s dng Website, (cc )sn phm v hoc dch v c cung cp theo Website (S Dng) c iu chnh bi cc iu kin, iu khon v thng bo di y (iu Khon S Dng). Bng vic S Dng Website, Bn ng  tt c iu Khon S Dng v Chnh sch bo v thng tin c nhn ca khch hng, c th c iu chnh, cp nht bi chng ti ty tng thi im m khng c thng bo trc. Bn c khuyn ngh nn thng xuyn kim tra trang ny  bit c nhng thay i i vi iu Khon S Dng. Vui lng hiu rng nu bn t chi chp thun iu Khon S Dng, bn s khng th s dng hoc mua bt c sn phm no ti Website.</span>\r\n\r\n<span style=\"font-weight: 400;\">1.2. Cc iu Khon S Dng ny l cam kt gia Bn v Revzone Yamaha Motor. Theo  Cng Ty sn sng cp cho Bn quyn truy cp vo Website ny.</span>\r\n\r\n<span style=\"font-weight: 400;\">1.3. Cng Ty c quyn thay i cc iu Khon S Dng ny ty tng thi im .Cc quyn ca Bn theo iu Khon S Dng ny s l quyn theo ni dung c ghi nhn ti phin bn mi nht ca iu Khon S Dng c ng trn Website ti thi im Bn s dng. Bng cch truy cp hoc thc hin bt c tc v no trn Website sau khi chng ti  cng b, bn ng  vi cc ni dung ca iu Khon S Dng nh  sa i tng ng.</span>\r\n<ol start=\"2\">\r\n 	<li><span style=\"font-weight: 400;\"> Quyn s dng v Truy cp Website</span></li>\r\n</ol>\r\n<span style=\"font-weight: 400;\">Cng Ty cp cho Bn quyn gii hn  truy cp v s dng Website ny v mc ch c nhn v khng c ti xung hoc sa i Website, hoc bt k phn no trong , tr khi c s ng  r rng bng vn bn t Cng Ty. Quyn s dng ny khng bao gm bt k vic bn li hoc s dng vi mc ch thng mi Website hoc ni dung Website; vic su tp, s dng bt k danh sch sn phm, m t hoc gi c; bt k vic s dng phi sinh no ca Website hoc ni dung Website; hoc bt k vic s dng khai thc d liu, r-bt hoc cc cng c thu thp v trch xut d liu tng t. Khng c m phng, sao chp, sao chp, bn, bn li, truy cp hoc khai thc Website hoc bt k phn no ca Website v bt k mc ch thng mi no m khng c s ng  r rng bng vn bn t Cng Ty. Bn khng c lm gi hoc s dng cc k thut lm gi  nh km bt k nhn hiu, biu tng hoc thng tin c quyn no khc (bao gm hnh nh, vn bn, b cc trang hoc biu mu) ca Cng Ty v cc cng ty lin kt(bao gm c Cng Ty m, \"Cng Ty Lin Kt\") m khng c s ng  r rng bng vn bn t Cng Ty. Bt k vic s dng tri php no u chm dt quyn s dng do Cng Ty cp.</span>');
