INSERT INTO `wp_postmeta` VALUES (29026, 498, 'content', '<h2 class=\"title\">Chnh sch cookie ca chng ti</h2>\r\nCookie l cc on vn bn c t trn  cng my tnh khi bn truy cp vo trnh duyt Web. Chng ti s dng cookie  phn tch d liu duyt Web v cho bit bt c khi no bn truy cp mt trang Web. Cc cookie cho php cc ng dng trang web phn hi thng tin n bn trn phng din c nhn. ng dng trang web c th iu chnh cc hot ng nhm p ng cc nhu cu ca bn bng cch thu thp v lu thng tin v s thch ca bn.\r\n\r\nChng ti s dng cc cookie lu lng nhm xc nh cc trang no hin ang c s dng. iu ny gip chng ti phn tch d liu v lu lng trang web v nng cp website ca chng ti nhm p ng nhu cu ca khch hng. Chng ti ch s dng thng tin ny cho mc ch phn tch thng k v sau  s xa d liu khi h thng.\r\n\r\nBn cnh , cookies cn gip chng ti mang li cho bn mt website tt hn bng cch to iu kin cho chng ti theo di cc trang m bn nhn thy hu ch hoc khng hu ch. Cookie khng th no gip chng ti truy cp vo my tnh ca bn hoc bt k thng tin no v bn ngoi cc d liu m bn chn  chia s vi chng ti.\r\n\r\nBn c th la chn chp nhn hoc t chi cc cookie. Hu ht cc trnh duyt web t ng chp nhn cc cookie, nhng bn c th thng xuyn thay i setting trnh duyt ca bn  t chi cc cookie nu bn mun. iu ny c th gy cn tr n vic bn nhn c li ch ti a t website.\r\n\r\n bit thm cc thng tin khc lin quan n qun l cookies vui lng tham kho ti mc All About Cookies hoc AboutCookies.org.');
