INSERT INTO `wp_postmeta` VALUES (29032, 500, 'content', '<h2 class=\"title\">Giao hng v tr li</h2>\r\n<b>CHNH SCH I TR CA REVZONE YAMAHA VIT NAM (P DNG CHO N HNG TRC TUYN)</b>\r\n\r\n<span style=\"font-weight: 400;\">n hng trc tuyn ngha l n hng c thc hin v thanh ton trn website chnh thc ca Revzone Yamaha Motor c t chc v vn hnh bi Yamaha Motor Vit Nam.</span>\r\n<ol>\r\n 	<li><span style=\"font-weight: 400;\"> i vi mt hng l Trang phc</span></li>\r\n</ol>\r\n<span style=\"font-weight: 400;\">Sn phm mua trc tuyn khng c li do sn xut ch c th c i khi p ng y  cc iu kin sau:</span>\r\n\r\n<span style=\"font-weight: 400;\">- c i trong 14 ngy k t ngy khch hng nhn c sn phm;</span>\r\n\r\n<span style=\"font-weight: 400;\">- Sn phm thay th phi cng m (dy 06 s c th hin trn nhn sn phm) vi sn phm cn i, ch chp nhn i mu v kch c (size);</span>\r\n\r\n<span style=\"font-weight: 400;\">- Sn phm cn mi v trong tnh trng ban u (khng bn, sn, qua s dng, try xc, hoc qua git, ty), nhn sn phm, nhn gi, v nhn khc (nu c) phi cn nguyn v nh km vi sn phm;</span>\r\n\r\n<span style=\"font-weight: 400;\">- Phiu i tr hng phi c in y  thng tin, k, ng du (nu c), v gi km vi sn phm. Trong trng hp hon tr hng ha, khch hng doanh nghip cn xut v gi li cho chng ti ha n thu gi tr gia tng (VAT);</span>\r\n\r\n<span style=\"font-weight: 400;\">- Sn phm phi cha qua chnh sa</span>\r\n<ol start=\"2\">\r\n 	<li><span style=\"font-weight: 400;\"> Khng i sn phm khng c mua t website chnh thc t Revzone Yamaha Motor.</span></li>\r\n 	<li><span style=\"font-weight: 400;\"> Chi ph vn chuyn cho vic i hng do khch hng chi tr.</span></li>\r\n 	<li><span style=\"font-weight: 400;\"> Khng p dng vic i tr ti ca hng i vi cc n hng trc tuyn.</span></li>\r\n 	<li><span style=\"font-weight: 400;\"> Bt c hnh thc khuyn mi, gim gi no c p dng cho cc sn phm i, tr s khng c tr li, hoc bi hon.</span></li>\r\n 	<li><span style=\"font-weight: 400;\"> Vic hon tin khng c p dng, tr trng hp sn phm c li do sn xut.</span></li>\r\n 	<li><span style=\"font-weight: 400;\"> Revzone Yamaha Motor c quyn t chi bt k yu cu no khng p ng nhng iu kin  nu  trn.</span></li>\r\n 	<li><span style=\"font-weight: 400;\"> Revzone Yamaha Motor c quyn sa i chnh sch ny bt k lc no.</span></li>\r\n</ol>\r\n<span style=\"font-weight: 400;\">CC BC I TR SN PHM CHO N HNG TRC TUYN</span>\r\n\r\n<span style=\"font-weight: 400;\"> m bo s thun tin cho khch hng, qu khch vui lng kim tra k cc iu kin trong chnh sch trc khi tin hnh quy trnh i tr.</span>\r\n\r\n<span style=\"font-weight: 400;\">Vui lng tham kho bi vit Lm th no  i/Tr sn phm (Cho n hng trc tuyn)  bit thm chi tit v quy trnh i tr.</span>');
