INSERT INTO `wp_postmeta` VALUES (30255, 1195, 'short_description', '<strong>Khi tc  hay speed block l hnh nh biu tng cho hot ng ua xe th thao ca Yamaha. Hnh nh ny c thit k nhm truyn ti s nhit huyt v tinh thn am m chinh phc tc .</strong>');
INSERT INTO `wp_postmeta` VALUES (30256, 1195, '_short_description', 'field_611277f24c36b');
INSERT INTO `wp_postmeta` VALUES (30257, 1195, 'content', '<span style=\"font-weight: 400;\">Khi tc  hay speed block l hnh nh biu tng cho hot ng ua xe th thao ca Yamaha. Hnh nh ny c thit k nhm truyn ti s nhit huyt v tinh thn am m chinh phc tc .</span>\r\n\r\n<img class=\"alignnone wp-image-1197 size-full\" src=\"https://yamaha-dev.demo-web.asia/wp/wp-content/uploads/2021/10/Q5KYSK001TA7.jpg\" alt=\"\" width=\"500\" height=\"312\" />\r\n\r\n<span style=\"font-weight: 400;\">Thit k ny ra i vo u nhng nm 70 ti M. Yamaha lc  to dng ting vang thng qua nhng thnh cng trong cc cuc ua xe m t ti Catalina GP 1958 v Daytona GP 1961.</span>\r\n\r\n<span style=\"font-weight: 400;\">Tuy nhin, l mt thng hiu c phn m nht vi b dy thnh tch, khng d  Yamaha c th cnh tranh trn th trng vi cc thng hiu xe my ni a ca M v chu u. V vy, Yamaha cn mt hnh nh n tng nhm lm ni bt s xut sc ca cc sn phm Yamaha. Trn cc c my ua ca mnh, Yamaha bt u s dng tng mu vng v en, ni bt nh s tng phn mt thit k  ha c to thnh bi cc khi vung, ging nh mt chui cc khi vung.</span>\r\n\r\n&nbsp;\r\n\r\n[caption id=\"attachment_1196\" align=\"aligncenter\" width=\"1024\"]<img class=\"wp-image-1196 size-full\" src=\"https://yamaha-dev.demo-web.asia/wp/wp-content/uploads/2021/10/Yamaha-SMAX-0.jpg\" alt=\"\" width=\"1024\" height=\"683\" /> <em>Kenny Roberts vi b tem Khi tc  ni bt trn trng ua vo nm 1978</em>[/caption]\r\n\r\n<span style=\"font-weight: 400;\">Nm 1978, cc khe k sc c chn vo cc ng khi quen thuc ny v thit k ny tr thnh mu tem c nh ca Yamaha trong gii ua xe M. Mu tem ny c bit n vi ci tn \"Khi tc \", v n c s dng trn tt c cc xe ca Yamaha, t ua ng n sn phm th nghim. Ti Nht Bn, ngi hm m hay gi cc xe mang hnh nh khi tc   v trng l tia chp, v xe no mang khi tc  vng v en l xe ua. </span>\r\n\r\n[caption id=\"attachment_1198\" align=\"aligncenter\" width=\"1024\"]<img class=\"wp-image-1198 size-full\" src=\"https://yamaha-dev.demo-web.asia/wp/wp-content/uploads/2021/10/CKXYilBWwAA-drb.jpg\" alt=\"\" width=\"1024\" height=\"619\" /> <em>YZR-M1 2005 phin bn c bit k nim 50 nm tham d MotoGP ca Yamaha</em>[/caption]\r\n\r\n<span style=\"font-weight: 400;\">T nhng nm 1980, mu sc ca nh ti tr cng c bt u xut hin nhiu hn trn xe ca Yamaha, nhng ch c khi tc  l thit k nguyn mu ca Yamaha. Bn cnh logo c trng, thit k \"khi tc \" chnh l nhng hnh nh biu tng y t ho v thn thuc ca Yamaha.</span>\r\n\r\n<span style=\"font-weight: 400;\">Ref: https://global.yamaha-motor.com/race/wgp-50th/column/vol17/</span>');
