INSERT INTO `wp_postmeta` VALUES (30291, 1200, 'short_description', '<strong>T mt nh sn xut gia nhp th trng mun mng ti Nht Bn, Yamaha  c nhng bc i vn ra u trng tc  th gii v to nn mt lch s ni ting ngy nay,</strong>');
INSERT INTO `wp_postmeta` VALUES (30292, 1200, '_short_description', 'field_611277f24c36b');
INSERT INTO `wp_postmeta` VALUES (30293, 1200, 'content', '<span style=\"font-weight: 400;\">T mt nh sn xut gia nhp th trng mun mng ti Nht Bn, Yamaha  c nhng bc i vn ra u trng tc  th gii v to nn mt lch s ni ting ngy nay.</span>\r\n\r\n[caption id=\"attachment_1203\" align=\"alignnone\" width=\"566\"]<img class=\"wp-image-1203 size-full\" src=\"https://yamaha-dev.demo-web.asia/wp/wp-content/uploads/2021/10/pic_006.jpg\" alt=\"\" width=\"566\" height=\"353\" /> i ua Yamaha ginh 3 bc cao nht ti cuc ua cao nguyn Asama[/caption]\r\n\r\n<b>CUC UA QUC T U TIN</b>\r\n\r\n<span style=\"font-weight: 400;\">Cc mu xe YA-1 v YD-1 ca Yamaha lin tc th hin s vt tri ti cc gii ua leo ni Ph S v gii ua cao nguyn Asama ti Nht Bn lin tip trong nhng nm 1955 v 1957. Vi s t tin v  ch chinh phc nhng thch thc cao hn, Yamaha quyt nh th sc  u trng quc t.</span>\r\n\r\n<span style=\"font-weight: 400;\">Nm 1958, Yamaha  tham d cuc ua quc t u tin vi gii Catalina Grand Prix ti M. Cuc ua c din ra ti o Santa Catalina thuc bang Los Angeles. Cuc ua c xem l Isle of Man ca chu M vi a hnh hn hp phc tp, vi hn 64km ng t v  xen k, cng nhiu dng a hnh t bng phng n i ni, v cc tay ua khng c bit trc ng ua.</span>\r\n\r\n<span style=\"font-weight: 400;\">Yamaha c i hnh gm 5 tay ua, trong  ch tay ua Fumio Ito l ngi Nht, bn cnh 4 tay ua ngi M khc. Tuy nhin, chnh Fumio Ito li to bt ng ln. </span>\r\n\r\n[caption id=\"attachment_1202\" align=\"alignnone\" width=\"250\"]<img class=\"wp-image-1202 size-full\" src=\"https://yamaha-dev.demo-web.asia/wp/wp-content/uploads/2021/10/pic_001.jpg\" alt=\"\" width=\"250\" height=\"316\" /> Fumio Ito thi u bn b ti Catalina Grand Prix nm 1958[/caption]\r\n\r\n<span style=\"font-weight: 400;\">Trn chic xe YD-1 ca mnh, Fumio Ito  thi u ht sc bn b. Fumio Ito  c mn bc ph ngon mc  chim v tr th 8 ca chng ua ngay t lc xut pht. Tuy nhin, bugi nh la ca ng c gp trc trc  khin Ito phi khc phc s c v tt xung v tr th 13. Ito vn kin tr thi u, ln lt vt ln v chim li cc hng  mt qua tng vng. Kt thc chng ua, Ito ch v ch  v tr s 6 nhng y l kt qu y n tng cho i ua Yamaha.  ch thi u bn b ca Ito cn ghi m du n vi khn gi M.</span>\r\n\r\n<b>N VI GII UA GRAND PRIX</b>\r\n\r\n<span style=\"font-weight: 400;\">Thnh tch ti Catalina  khng nh cht lng sn phm vt tri ca YD-1 cng nh Yamaha, gip Yamaha thm t tin n vi u trng Grand Prix danh gi nht. Nm 1961, Yamaha th sc vi gii u danh gi nht  gii Grand Prix ti chu u vi hai chng ua ti Anh v Php. Gii Grand Prix ny chnh l tin thn ca MotoGP ngy nay.</span>\r\n\r\n[caption id=\"attachment_1201\" align=\"alignnone\" width=\"566\"]<img class=\"wp-image-1201 size-full\" src=\"https://yamaha-dev.demo-web.asia/wp/wp-content/uploads/2021/10/pic_003.jpg\" alt=\"\" width=\"566\" height=\"353\" /> <em>Fumio Ito i din Yamaha tham d chng ua Grand Prix ti Anh nm 1961</em>[/caption]\r\n\r\n<span style=\"font-weight: 400;\">Thnh tch hng 6 chng ua Grand Prix ti Anh  khng nh quyt tm chinh phc thch thc ca Yamaha ti u trng Grand Prix. K t , Yamaha  khng ngng n lc chinh phc cc thnh tch cao hn v to nn tn tui trong lng MotoGP vi hng trm trn thng trong sut 60 nm qua.</span>');
