INSERT INTO `wp_postmeta` VALUES (30320, 1205, 'short_description', '<strong>Khu hiu ny l s tip ni gia tinh thn n v sng to khng ngng ngh ca Yamaha Motor t lc trong chng ng pht trin hn 60 nm qua.</strong>');
INSERT INTO `wp_postmeta` VALUES (30321, 1205, '_short_description', 'field_611277f24c36b');
INSERT INTO `wp_postmeta` VALUES (30322, 1205, 'content', '<span style=\"font-weight: 400;\">Khu hiu ny l s tip ni gia tinh thn n v sng to khng ngng ngh ca Yamaha Motor t lc trong chng ng pht trin hn 60 nm qua.</span>\r\n\r\n<span style=\"font-weight: 400;\">Revs your heart  Khi dy am m chnh thc tr thnh khu hiu ton cu ca Yamaha t nm 2013, thay th cho khu hiu Be the one c s dng t nm 2008.</span>\r\n\r\n[caption id=\"attachment_1206\" align=\"alignnone\" width=\"1024\"]<img class=\"wp-image-1206 size-large\" src=\"https://yamaha-dev.demo-web.asia/wp/wp-content/uploads/2021/10/maxresdefault-1-1024x576.jpg\" alt=\"\" width=\"1024\" height=\"576\" /> <em>Tenere 700  mt trong nhng mu xe ca am m chinh phc</em>[/caption]\r\n\r\n<span style=\"font-weight: 400;\">Khu hiu c thit k theo trit l tinh t v nng ng\". Cc t ng c sp xp theo chiu nghing, hng ln trn, t tri sang phi, kt hp vi mt nt gch di dt khot, tng trng cho hnh ng tng tc, phng ga mnh, bt ph v pha trc.</span>\r\n\r\n<span style=\"font-weight: 400;\">T Revs th hin s tng tc vng tua ca ng c, tng trng cho s phn khch trong qu trnh s dng sn phm. Revs your Heart th hin khao kht em n s phn khch cho khch hng qua cc sn phm vt tri ca Yamaha.</span>\r\n\r\n<span style=\"font-weight: 400;\">Hnh trnh hn 60 nm qua vi a dng cc sn phm v hng triu mu xe  c bn ra chnh l li khng nh cho cam kt ca Yamaha i vi khch hng. Yamaha s khng ngng to ra nhng gi tr v tri nghim vt tri, lm phong ph cuc sng v khi dy am m cho mi khch hng.</span>');
