INSERT INTO `wp_postmeta` VALUES (31246, 1230, 'content', '<h2 class=\"title\">Giao hng v tr li</h2>\r\n<b>CHNH SCH I TR CA REVZONE YAMAHA VIT NAM (P DNG CHO N HNG TRC TUYN)</b>\r\n\r\n<span style=\"font-weight: 400;\">n hng trc tuyn ngha l n hng c thc hin v thanh ton trn website chnh thc ca Revzone Yamaha Motor c t chc v vn hnh bi Yamaha Motor Vit Nam.</span>\r\n<ol>\r\n 	<li><span style=\"font-weight: 400;\"> i vi mt hng l Trang phc</span></li>\r\n</ol>\r\n<span style=\"font-weight: 400;\">Sn phm mua trc tuyn khng c li do sn xut ch c th c i khi p ng y  cc iu kin sau:</span>\r\n\r\n<span style=\"font-weight: 400;\">- c i trong 14 ngy k t ngy khch hng nhn c sn phm;</span>\r\n\r\n<span style=\"font-weight: 400;\">- Sn phm thay th phi cng m (dy 06 s c th hin trn nhn sn phm) vi sn phm cn i, ch chp nhn i mu v kch c (size);</span>\r\n\r\n<span style=\"font-weight: 400;\">- Sn phm cn mi v trong tnh trng ban u (khng bn, sn, qua s dng, try xc, hoc qua git, ty), nhn sn phm, nhn gi, v nhn khc (nu c) phi cn nguyn v nh km vi sn phm;</span>\r\n\r\n<span style=\"font-weight: 400;\">- Phiu i tr hng phi c in y  thng tin, k, ng du (nu c), v gi km vi sn phm. Trong trng hp hon tr hng ha, khch hng doanh nghip cn xut v gi li cho chng ti ha n thu gi tr gia tng (VAT);</span>\r\n\r\n<span style=\"font-weight: 400;\">- Sn phm phi cha qua chnh sa</span>\r\n<ol start=\"2\">\r\n 	<li><span style=\"font-weight: 400;\"> Khng i sn phm khng c mua t website chnh thc t Revzone Yamaha Motor.</span></li>\r\n 	<li><span style=\"font-weight: 400;\"> Chi ph vn chuyn cho vic i hng do khch hng chi tr.</span></li>\r\n 	<li><span style=\"font-weight: 400;\"> Khng p dng vic i tr ti ca hng i vi cc n hng trc tuyn.</span></li>\r\n 	<li><span style=\"font-weight: 400;\"> Bt c hnh thc khuyn mi, gim gi no c p dng cho cc sn phm i, tr s khng c tr li, hoc bi hon.</span></li>\r\n 	<li><span style=\"font-weight: 400;\"> Vic hon tin khng c p dng, tr trng hp sn phm c li do sn xut.</span></li>\r\n 	<li><span style=\"font-weight: 400;\"> Revzone Yamaha Motor c quyn t chi bt k yu cu no khng p ng nhng iu kin  nu  trn.</span></li>\r\n 	<li><span style=\"font-weight: 400;\"> Revzone Yamaha Motor c quyn sa i chnh sch ny bt k lc no.</span></li>\r\n</ol>\r\n<span style=\"font-weight: 400;\">CC BC I TR SN PHM CHO N HNG TRC TUYN</span>\r\n\r\n<span style=\"font-weight: 400;\"> m bo s thun tin cho khch hng, qu khch vui lng kim tra k cc iu kin trong chnh sch trc khi tin hnh quy trnh i tr.</span>\r\n\r\n<span style=\"font-weight: 400;\">Vui lng tham kho bi vit Lm th no  i/Tr sn phm (Cho n hng trc tuyn)  bit thm chi tit v quy trnh i tr.</span>');
INSERT INTO `wp_postmeta` VALUES (31247, 1230, '_content', 'field_616ab46af04d5');
INSERT INTO `wp_postmeta` VALUES (31248, 1231, 'content', '<b>IU KHON S DNG</b>\r\n<ol>\r\n 	<li><span style=\"font-weight: 400;\"> iu Khon S Dng Website</span></li>\r\n</ol>\r\n<span style=\"font-weight: 400;\">1.Gii thiu</span>\r\n\r\n<span style=\"font-weight: 400;\">1.1. Cho mng bn n vi (\"Website\"). Chng ti cung cp thng tin cho bn (Bn hoc Ngi Dng) trn Website theo cc iu khon v iu kin ti vn bn ny. Bng cch truy cp, s dng Website, (cc )sn phm v hoc dch v c cung cp theo Website (S Dng) c iu chnh bi cc iu kin, iu khon v thng bo di y (iu Khon S Dng). Bng vic S Dng Website, Bn ng  tt c iu Khon S Dng v Chnh sch bo v thng tin c nhn ca khch hng, c th c iu chnh, cp nht bi chng ti ty tng thi im m khng c thng bo trc. Bn c khuyn ngh nn thng xuyn kim tra trang ny  bit c nhng thay i i vi iu Khon S Dng. Vui lng hiu rng nu bn t chi chp thun iu Khon S Dng, bn s khng th s dng hoc mua bt c sn phm no ti Website.</span>\r\n\r\n<span style=\"font-weight: 400;\">1.2. Cc iu Khon S Dng ny l cam kt gia Bn v Revzone Yamaha Motor. Theo  Cng Ty sn sng cp cho Bn quyn truy cp vo Website ny.</span>\r\n\r\n<span style=\"font-weight: 400;\">1.3. Cng Ty c quyn thay i cc iu Khon S Dng ny ty tng thi im .Cc quyn ca Bn theo iu Khon S Dng ny s l quyn theo ni dung c ghi nhn ti phin bn mi nht ca iu Khon S Dng c ng trn Website ti thi im Bn s dng. Bng cch truy cp hoc thc hin bt c tc v no trn Website sau khi chng ti  cng b, bn ng  vi cc ni dung ca iu Khon S Dng nh  sa i tng ng.</span>\r\n<ol start=\"2\">\r\n 	<li><span style=\"font-weight: 400;\"> Quyn s dng v Truy cp Website</span></li>\r\n</ol>\r\n<span style=\"font-weight: 400;\">Cng Ty cp cho Bn quyn gii hn  truy cp v s dng Website ny v mc ch c nhn v khng c ti xung hoc sa i Website, hoc bt k phn no trong , tr khi c s ng  r rng bng vn bn t Cng Ty. Quyn s dng ny khng bao gm bt k vic bn li hoc s dng vi mc ch thng mi Website hoc ni dung Website; vic su tp, s dng bt k danh sch sn phm, m t hoc gi c; bt k vic s dng phi sinh no ca Website hoc ni dung Website; hoc bt k vic s dng khai thc d liu, r-bt hoc cc cng c thu thp v trch xut d liu tng t. Khng c m phng, sao chp, sao chp, bn, bn li, truy cp hoc khai thc Website hoc bt k phn no ca Website v bt k mc ch thng mi no m khng c s ng  r rng bng vn bn t Cng Ty. Bn khng c lm gi hoc s dng cc k thut lm gi  nh km bt k nhn hiu, biu tng hoc thng tin c quyn no khc (bao gm hnh nh, vn bn, b cc trang hoc biu mu) ca Cng Ty v cc cng ty lin kt(bao gm c Cng Ty m, \"Cng Ty Lin Kt\") m khng c s ng  r rng bng vn bn t Cng Ty. Bt k vic s dng tri php no u chm dt quyn s dng do Cng Ty cp.</span>');
