INSERT INTO `wp_postmeta` VALUES (31285, 1240, 'content', '<span style=\"font-weight: 400;\">Cho mng bn n trang tuyn dng ca Revzone Yamaha Motor. Ti Revzone Yamaha Motor Vit Nam, bn s c c hi khm ph bn thn t cng vic hng ngy  gii phng tim nng bn trong bn, t  bn s tm thy am m t nhng nim vui trong cng vic. Cng vi tinh thn chp nhn th thch, bn s tng bc to ra gi tr, tm ra c m v m cnh ca tng lai.</span>\r\n\r\n<b>Quyn li</b>\r\n\r\n<span style=\"font-weight: 400;\">c tham gia mi trng lm vic nng ng, tr trung.</span>\r\n\r\n<span style=\"font-weight: 400;\">Nhng bi vit c cng ng n nhn tt nht s nhn c nhng phn thng vo cui thng.</span>\r\n\r\n<span style=\"font-weight: 400;\">Cng tc vin s c nhn giy chng nhn Cng tc vin ca YBOX.VN sau 3 thng hon thnh tt cng vic.</span>\r\n\r\n<span style=\"font-weight: 400;\">CTV c kt qu lm vic xut sc c th tr thnh Qun l chnh thc (Manager) v hng lng theo quy nh chung</span>\r\n\r\n<b>Cc v tr tuyn dng</b>\r\n<ol>\r\n 	<li><b> K THUT VIN BIG BIKE</b></li>\r\n</ol>\r\n<span style=\"font-weight: 400;\">CHI NHNH H CH MINH</span>\r\n\r\n<span style=\"font-weight: 400;\"></span><span style=\"font-weight: 400;\">Nhim v:</span>\r\n\r\n<span style=\"font-weight: 400;\">- iu chnh, sa cha hoc thay th ph tng nhm m bo xe hot ng an ton v hiu qu.</span>\r\n\r\n<span style=\"font-weight: 400;\">- Kim tra ph tng, vt t trong khu vc lm vic c giao  m bo lun c  ph tng thay th cn thit.</span>\r\n\r\n<span style=\"font-weight: 400;\">- Chun b hoc gii thch r cng vic phi lm bng cch ch thch vo bng cng vic treo trn xe trc khi bt u sa cha.</span>\r\n\r\n<span style=\"font-weight: 400;\">- Quan st v trc tip chy th xe sau khi sa  m bo xe vn hnh an ton, hiu qu v ng tin cy trc khi giao xe li cho khch hng.</span>\r\n\r\n<span style=\"font-weight: 400;\">- Lm cc dch v hu mi theo yu cu.</span>\r\n\r\n<span style=\"font-weight: 400;\">- C kh nng i tour cng vi khch hng.</span>\r\n\r\n<span style=\"font-weight: 400;\">- C kh nng p ng nu khch hng gi trong trng hp khn cp.</span>\r\n\r\n<span style=\"font-weight: 400;\"></span><span style=\"font-weight: 400;\"> a im lm vic:</span>\r\n\r\n<span style=\"font-weight: 400;\">Trung tm bo hnh Yamaha 627 Cch mng thng 8 Qun 10 thnh ph H Ch Minh</span>\r\n\r\n<span style=\"font-weight: 400;\">( C th chuyn n a im mi trong thnh ph khi c yu cu )</span>\r\n\r\n<span style=\"font-weight: 400;\"></span><span style=\"font-weight: 400;\">Yu cu:</span>\r\n\r\n<span style=\"font-weight: 400;\">- Tt nghip trung cp ngh hoc bng cp tng ng lin quan n nghnh c kh.</span>\r\n\r\n<span style=\"font-weight: 400;\">- C 01 nm kinh nghim hoc sinh vin mi ra trng nhng c kin thc v nghnh c kh.</span>\r\n\r\n<span style=\"font-weight: 400;\">- C am m, nhit tnh trong cng vic.</span>\r\n\r\n<span style=\"font-weight: 400;\">- C tinh thn trch nhim, v  thc t gic.</span>\r\n\r\n<span style=\"font-weight: 400;\">- C bng li xe A2 l li th.</span>\r\n\r\n<span style=\"font-weight: 400;\">- C kh nng c ting Anh l li th (Khng bt buc )</span>\r\n\r\n<span style=\"font-weight: 400;\"></span><span style=\"font-weight: 400;\"> iu kin lm vic:</span>\r\n<ul>\r\n 	<li><span style=\"font-weight: 400;\"> Ngy lm vic: trung bnh 22 ngy lm vic/ 1 thng.</span></li>\r\n 	<li><span style=\"font-weight: 400;\"> Thi gian lm vic: Theo ca. Ca 1: 8h~17h. Ca 2: 12h~20h. (c th linh hot thay i).</span></li>\r\n 	<li><span style=\"font-weight: 400;\"> Mc lng tho ng, vi nhiu ch  phc li khc bn cnh cc ch  theo lut Lao ng quy nh cng mi trng lm vic chuyn nghip v c hi o to cho nhng ngi thnh cng.</span></li>\r\n</ul>\r\n<span style=\"font-weight: 400;\"></span><span style=\"font-weight: 400;\">H s c th np trc tip hoc gi bng th in t n mt trong cc a ch sau:</span>\r\n<ol>\r\n 	<li><span style=\"font-weight: 400;\"> Vn phng cng ty TNHH Yamaha Motor Vit Nam</span></li>\r\n</ol>\r\n<span style=\"font-weight: 400;\">Tng 18 Ta nh MB 259 Trn Hng o, Phng C giang, Q1, TPHCM (Np ti quy l tn)</span>\r\n<ol start=\"2\">\r\n 	<li><span style=\"font-weight: 400;\"> Hm th tuyn dng: career@yamaha-motor.com.vn</span></li>\r\n</ol>\r\n<span style=\"font-weight: 400;\">H s bao gm: (H s ghi r v tr ng tuyn)</span>\r\n\r\n<span style=\"font-weight: 400;\">YU CU BT BUC: Mu ng k tuyn dng bng ting Anh hoc ting Vit (c nh);</span>\r\n\r\n<span style=\"font-weight: 400;\">(Download ti website: http://yamaha-motor.com.vn/tuyen-dung/hochiminh</span>\r\n\r\n<span style=\"font-weight: 400;\">- n xin vic. Bn tm tt qu trnh lm vic v kinh nghim bn thn (CV)</span>\r\n\r\n<span style=\"font-weight: 400;\">- Bn sao cc vn bng, chng ch lin quan c cng chng.</span>\r\n\r\n<span style=\"font-weight: 400;\">Hn nhn h s: Ht ngy 30/10/2029 (Ch lin h vi nhng h s t yu cu.Vui lng khng lin lc qua in thoi.)</span>\r\n\r\n<b>ng vin lu :</b>\r\n\r\n<span style=\"font-weight: 400;\">- Thi gian thi tuyn v phng vn s c thng bo qua email &amp; qua SMS ca ng vin.</span>\r\n\r\n<span style=\"font-weight: 400;\">- Cng ty s yu cu ng vin b sung h s bn sao cng chng khi trng tuyn ng thi s tin hnh i chiu Bng TN v Bng im (gc) trong qu trnh phng vn, th sinh vui lng chun b sn trc khi tham gia phng vn</span>');
