INSERT INTO `wp_postmeta` VALUES (31295, 1241, 'content', '<span style=\"font-weight: 400;\">Cng ty TNHH Yamaha Motor Vit Nam c thnh lp vo ngy 24 thng nm 1998 vi vn iu l 37 triu USD qua doanh gia Vit Nam, Nht Bn, v Malaysia. Cng ty c tr s chnh ti x Trung Gi, huyn Sc Sn, H Ni.</span>\r\n\r\n<a href=\"https://vietnhatec.com/wp-content/uploads/yamaha-factory-1.jpg\">https://vietnhatec.com/wp-content/uploads/yamaha-factory-1.jpg</a>\r\n\r\n<span style=\"font-weight: 400;\">Yamaha Motor Vit Nam (YMVN) chuyn sn xut v lp rp xe my nhn hiu Yamaha, linh kin, ph tng xe my v cung cp dch v bo hnh sa cha xe my. Qua hn 20 nm pht trin, h thng i l ca Yamaha Motor Vit Nam  t n con s hn 300 i l, ca hng trn khp Vit Nam. H thng tiu chun cng nh hnh nh ca i l, ca hng, phng trng by cng lin tc c nng cp. Hin cng ty ang vn hnh hai nh my vi din tch hn 100,000 m</span><span style=\"font-weight: 400;\">2</span><span style=\"font-weight: 400;\"> vi i ng hn 6500 nhn vin.</span>\r\n\r\n<a href=\"https://lh3.googleusercontent.com/proxy/JDoANVdYIJwO4nXLkIOWGx07HVd9s0n-qGYgSWHViQsGBKAEiteprkVDbuQtvkOYT5wzUkqPYL5pmaa33KS7Yk88zhNNvANstFTqtwRzovqfmrddEkt1oJZRd8osEA\"><span style=\"font-weight: 400;\">https://lh3.googleusercontent.com/proxy/JDoANVdYIJwO4nXLkIOWGx07HVd9s0n-qGYgSWHViQsGBKAEiteprkVDbuQtvkOYT5wzUkqPYL5pmaa33KS7Yk88zhNNvANstFTqtwRzovqfmrddEkt1oJZRd8osEA</span></a><span style=\"font-weight: 400;\"></span>\r\n\r\n<span style=\"font-weight: 400;\">Vi phng chm TR THNH CNG TY TO RA KANDO, Yamaha Motor Vit Nam khng ngng n lc nhm hin thc ha gic m ca mi khch hng vi nim am m v kht khao sng to, lun i tin phong mang li nhng sn phm tuyt ho v gi tr vt tri tha mn s mong i ca khch hng. Vi khu hiu Khi dy am m, to ra nhng gi tr v tri nghim vt tri, lm phong ph cuc sng cho mi khch hng, Yamaha Motor Vit Nam phn u tr thnh mt thnh vin tch cc ca cng ng Vit Nam, nhanh chng gp phn vo s pht trin ca ngnh cng nghip Vit Nam trong lnh vc sn xut xe gn my. </span>');
