INSERT INTO `wp_postmeta` VALUES (31304, 1242, 'content', '<b>HNG DN T V S DNG DCH V</b>\r\n\r\n<span style=\"font-weight: 400;\">Hy chm sc v bo v chin m ca bn theo cch ring. Khm ph ngay nhng gi dch v ph hp.</span>\r\n\r\n<span style=\"font-weight: 400;\">Bc 1: Tm kim v chn dch v/ gi dch v mong mun</span>\r\n\r\n<span style=\"font-weight: 400;\">Bc 2: Chn DO/Dealer</span>\r\n\r\n<span style=\"font-weight: 400;\">Bc 3: Tin thnh t hnh v thanh ton</span>\r\n\r\n<span style=\"font-weight: 400;\">Bc 4: n DO/Dealer  chn</span>\r\n\r\n<span style=\"font-weight: 400;\">Bc 5: Nhn vin chm sc khch hng kim tra thng tin v tin hnh thc hin dch v.</span>');
