INSERT INTO `wp_postmeta` VALUES (32795, 1239, 'short_description', '<span style=\"font-weight: 400;\">Ngi Torakusu Yamaha, nh sng lp v i ca tp on Yamaha ngy nay, c xem l mt trong nhng huyn thoi v khi nghip v tinh thn chinh phc thch thc.</span>');
INSERT INTO `wp_postmeta` VALUES (32796, 1239, '_short_description', 'field_611277f24c36b');
INSERT INTO `wp_postmeta` VALUES (32797, 1239, 'content', '<i><span style=\"font-weight: 400;\">Chn dung nh sng lp Torakusu Yamaha</span></i>\r\n\r\n<img class=\"alignnone size-full wp-image-1403\" src=\"https://yamaha-dev.demo-web.asia/wp/wp-content/uploads/2021/11/pict_torakusu.jpeg\" alt=\"\" width=\"540\" height=\"654\" />\r\n\r\n<b>NIM AM M MNH LIT VI C KH</b>\r\n\r\n<span style=\"font-weight: 400;\">Nm 1851, Torakusu Yamaha ra i trong mt gia nh theo truyn thng samurai ngho kh ti tnh Wakayama. Cha ng l nh nghin cu thin vn hc, nn ngay t nh, Torakusu  c tip xc vi v hnh thnh am m vi cc loi my mc tinh xo cng nh sch v khoa hc k thut.</span>\r\n\r\n<img class=\"alignnone size-full wp-image-1406\" src=\"https://yamaha-dev.demo-web.asia/wp/wp-content/uploads/2021/11/wakayama-castle-2017-1.jpeg\" alt=\"\" width=\"640\" height=\"480\" />\r\n\r\n<span style=\"font-weight: 400;\">ng bt u thnh tho sa cha cc loi my mc nh ng h, thit b y t v hc thm kinh doanh. Tuy nhin, cng vic sa cha t ph bin thi  v nhiu khi ng phi i lm phu xe  trang tri cuc sng. Nm 1887, mt s kin  thay i hon ton cuc i Torakusu cng nh lch s sn xut nhc c ca Nht Bn.</span>\r\n\r\n<b>TO RA CHIC N ORGAN U TIN CA NHT BN</b>\r\n\r\n<span style=\"font-weight: 400;\">Thi im , nhc c phng Ty, c bit l piano rt t  v gn nh khng c ngi bit sa cha. Ti trng tiu hc Jinjo, thnh ph Hanamatsu c mt cy n organ nhp khu t M v khng may b hng. Torakusu c mi n v  khng gp nhiu kh khn  sa thnh cng chic n.</span>\r\n\r\n<span style=\"font-weight: 400;\">Tuy nhin, ng b n tng mnh bi k thut c kh ca chic n v tm quan trng ca loi nhc c ny. S kin ny  thi bng quyt tm ch to n cho qu hng ca Torakusu, mc d khi  ng cha h c kin thc v sn xut.</span>\r\n\r\n<i><span style=\"font-weight: 400;\">Chic n organ m Torakusu  sa</span></i>\r\n\r\n<img class=\"alignnone size-full wp-image-1404\" src=\"https://yamaha-dev.demo-web.asia/wp/wp-content/uploads/2021/11/ORGAN-YAMAHA.jpeg\" alt=\"\" width=\"600\" height=\"315\" />\r\n\r\n<span style=\"font-weight: 400;\">ng cng mt ngi bn  ngy m my m v hon thnh mt nguyn mu. Hai ngi  khng qun kh nhc, cng trn lng chic n organ ny vt o Hakone, bng qua chng ng hn 250km  t qu nh n Nhc vin Tokyo  kho nghim. Cy n mc d c nh gi cao v thit k nhng li b ch trch nng n v m iu.</span>\r\n\r\n<i><span style=\"font-weight: 400;\">Dng c m Torakusu s dng  hc v m iu</span></i>\r\n\r\n<img class=\"alignnone size-full wp-image-1405\" src=\"https://yamaha-dev.demo-web.asia/wp/wp-content/uploads/2021/11/040921-Chan-dung-nha-sang-lap.png\" alt=\"\" width=\"1206\" height=\"576\" />\r\n\r\n<span style=\"font-weight: 400;\">Khng nn ch, ng   li Tokyo  my m hc v chnh m nhc c. Sau bn thng vt ln vi  loi kin thc v nhc l v m iu, ng cui cng  hon thin c phn m iu, qua , to ra chic n organ u tin ca Nht Bn.</span>\r\n\r\n<span style=\"font-weight: 400;\">Torakusu  v qu nh v thnh lp cng ty Nippon Gakki chuyn sn xut n organ. Cng ty c i tn thnh cng ty Yamaha nm 1897 v chnh l tp on Yamaha ngy nay. Hai nm sau, ng n M  nghin cu ch tc n piano v Yamaha  cho ra i nhng cy n piano vo nm tip theo.</span>\r\n\r\n<span style=\"font-weight: 400;\">Nh sng lp Torakusu Yamaha qua i nm 1916. ng  hon thnh c li ha vi chnh mnh v qu hng. Di sn ln nht ca ng, tp on Yamaha l cng ty sn xut n v nhc c ln nht th gii hin nay.</span>');
