INSERT INTO `wp_postmeta` VALUES (32814, 1373, 'short_description', '<span style=\"font-weight: 400;\">Gn khu vc bnh xng trn bt k mu xe no Yamaha sn xut u l mt hnh trn c dp ni rt bt mt.  chnh l logo ca Yamaha Motor nhng t ngi bit c  ngha hnh nh ny.</span>');
INSERT INTO `wp_postmeta` VALUES (32815, 1373, '_short_description', 'field_611277f24c36b');
INSERT INTO `wp_postmeta` VALUES (32816, 1373, 'content', '<span style=\"font-weight: 400;\">Logo u tin ca Yamaha c ra mt nm 1888, vi hnh nh ch chim phng hong ngm trong mnh chic m thoa. n nay, tri qua gn 130 nm lch s vi nhiu ln thay i nhn din thng hiu, Yamaha lun gi gn v tn vinh gi tr ct li c th hin ngay t nhng ngy u.</span>\r\n\r\n<span style=\"font-weight: 400;\">c thm cu chuyn s mnh phng hong huyn thoi ca chic logo ny </span><b>ti y</b><span style=\"font-weight: 400;\">.</span>\r\n\r\n<span style=\"font-weight: 400;\">Nm 1916, logo phng hong c thay th bng hnh nh 3 chic m thoa an xen vo nhau, biu trng cho s cn bng, hi t ca 3 yu t trong m nhc: giai iu, nhp iu v ha hp. Mt s phin bn logo khc ng vi tng sn phm nhc c nh piano, organ ln lt ra i, cng nh cc phin bn ring cho n phm truyn thng.</span>\r\n\r\n<img class=\"alignnone size-full\" src=\"https://i2.wp.com/img.v3.news.zdn.vn/w660/Uploaded/wyhktpu/2016_08_30/Untitled.jpg\" width=\"660\" height=\"191\" />\r\n\r\n<span style=\"font-weight: 400;\">Khi n v sn xut ng c chnh thc tch khi tp on v tr thnh cng Yamaha Motor nm 1955, hnh nh ba m thoa an xen ny tip tc c s dng nhng c thm mt s ci tin. Logo mi c thm mt vng trn bao pha ngoi, m phng hnh dng chic bnh xe khi chuyn ng, gi nhc ti tnh v cc sn phm xe my v m t ca cng ty mi.</span>\r\n\r\n<a href=\"https://global.yamaha-motor.com/about/philosophy/img/logo_yamahamotor.png\"><span style=\"font-weight: 400;\"><img class=\"alignnone size-full\" src=\"https://global.yamaha-motor.com/about/philosophy/img/logo_yamahamotor.png\" width=\"696\" height=\"173\" /></span></a><span style=\"font-weight: 400;\"></span>\r\n\r\n<span style=\"font-weight: 400;\">K tha trit l kinh doanh ca nh sng lp Torakusu Yamaha, mi chic m thoa vn i din cho ba on th ln  cng ty l cng ngh, sn xut v bn hng. Ngoi ra, Logo mi va th hin cho s ng thun, gn kt cht ch trong tp th Yamaha, va biu trng kh cht mnh m ca mt hng sn xut xe my: Hy cng nhau chinh phc th trng th gii bng s phi hn nhp nhng gia cng ngh, sn xut, v bn hng.</span>\r\n\r\n<span style=\"font-weight: 400;\">Ngy nay, ba m thoa cn mang i din cho \"Khch hng\", \"X hi\" v \"C nhn\", tng trng cho cc nguyn tc qun l ca Yamaha Motor l mt cng ty to ra gi tr vt qua s mong i ca khch hng, ng thi thc hin trch nhim i vi x hi vi t cch l doanh nghip ton cu, v nui dng vn ha doanh nghip, ni tt c nhn vin u cm thy t ho.</span>');
