INSERT INTO `wp_postmeta` VALUES (32852, 1375, '_short_description', 'field_611277f24c36b');
INSERT INTO `wp_postmeta` VALUES (32853, 1375, 'content', '<i><span style=\"font-weight: 400;\">Kando  trit l lm nn s c o a Yamaha</span></i>\r\n\r\n<img class=\"alignnone size-full\" src=\"https://www.yamaha-motor.eu/content/dam/yamaha-motor-europe/about-us-section/Kando.jpg/jcr:content/renditions/cq5dam.web.2000.2000.jpeg\" width=\"300\" height=\"182\" />\r\n\r\n<span style=\"font-weight: 400;\">KANDO l mt t ting Nht din t cm xc va hi lng va phn khch mnh m khi tri nghim mt iu g  c gi tr vt tri.</span>\r\n\r\n<span style=\"font-weight: 400;\">K t khi cng ty thnh lp nm 1955, Yamaha Motor  mang trn mnh s mnh tr thnh mt cng ty to ra Kando. Yamaha Motor khng ngng n lc phn u nhm hin thc ha gic m ca mi khch hng vi nim am m v kht khao sng to, lun i tin phong mang li nhng sn phm tuyt ho v gi tr vt tri tha mn s mong i ca khch hng.</span>\r\n\r\n<span style=\"font-weight: 400;\">Trit l Kando c to nn bi 5 yu t: Sng to, Cm xc, Phn khch, T tin v Kt ni.</span>\r\n\r\n<b>KHNG NGNG SNG TO ()</b>\r\n\r\n<span style=\"font-weight: 400;\">Yamaha khng ngng sng to  to ra nhng tri nghim c o v khi dy am m ca khch hng, tr thnh ngi tin phong to ra cc gi tr t ph. iu ny  c th hin qua nhiu mu xe nh YA-1 vi ci tin hp s, cn p v mu sc hon ton ni bt nm 1955, mu xe mang hp s 5 cp u tin ti Nht Bn YD-1 nm 1957, mu xe a a hnh u tin ca th gii DT-1 nm 1968 hay cc cng ngh  lm thay i lch s ngnh xe my nh h thng t bi trn Autolube cho xe 2 th, ng c Genesis, ng c Bluecore.</span>\r\n\r\n<img class=\"alignnone size-full\" src=\"https://cdn2.yamaha-motor.eu/prod/product-assets/2021/MT09/2021-Yamaha-MT09-EU-Detail-007-03.jpg\" width=\"2000\" height=\"1125\" />\r\n\r\n<i><span style=\"font-weight: 400;\">MT-09 vi nhng cng ngh t ph hng u phn khc. Tm hiu thm v MT-09 </span></i><b><i>ti y</i></b><i><span style=\"font-weight: 400;\">.</span></i>\r\n\r\n<b>LAY NG CM XC ()</b>\r\n\r\n<span style=\"font-weight: 400;\">Yamaha lun thit k cc sn phm nhm lay ng cm xc v cm quan ngh thut ca khch hng. Nu sn phm khng mang li nhng tri nghim y cm xc,  khng phi l sn phm ca Yamaha. y l truyn thng c o ca ring Yamaha, mt di sn c k tha v pht huy qua hn 60 trong lnh vc sn xut m nhc t Yamaha Music.</span>\r\n\r\n<i><span style=\"font-weight: 400;\">ng nt thit k mnh m v thanh lch ca Xmax. Tm hiu thm v mu xe ny </span></i><b><i>ti y</i></b><i><span style=\"font-weight: 400;\">.</span></i>\r\n\r\n<img class=\"alignnone size-full\" src=\"https://image.thanhnien.vn/1024/uploaded/bahung/z-ba-hung-2021/thang-3-2021/yamaha-xmax/yamaha-xmax-300_thanhnien-4_ivby.jpg\" width=\"1024\" height=\"605\" />\r\n\r\n<span style=\"font-weight: 400;\">Nhng ng nt thit k ca Yamaha lun mang s to bo nhng tinh t v ngh thut, nng ng nhng cng rt chau chut, th hin s hi ha gia cht lng v  hon thin tinh xo.</span>\r\n\r\n<b>EM TI S PHN KHCH ()</b>\r\n\r\n<span style=\"font-weight: 400;\">Yamaha khng ngng n lc nhm to ra cc sn phm vi cht lng cao nht, to ra nhng tri nghim trn y s phn khch, thch th v trn ngp nim vui trong qu trnh s dng. Chng hn, dng sn phm hyper naked ca Yamaha c bit n vi c tnh m men xon bng n nhng hon ton mt m trong qu trnh tng tc, kt hp cng h thng ga in t chnh xc, mang li cm gic li chn tht vi mi hnh ng iu khin v cm xc ca ngi li. Yamaha cng l nh sn xut u tin thnh lp cc trng o to li xe an ton v k nng li xe a hnh ti Nht Bn nhng nm 1968 nhm gip khch hng tn hng sn phm cch trn vn nht</span>\r\n\r\n<b>GIP BN T TIN ()</b>\r\n\r\n<span style=\"font-weight: 400;\">We will give our customers reliability and peace of mind</span>\r\n\r\n<span style=\"font-weight: 400;\">No matter how fun or exciting a product may be, you cannot call it Kando if it doesnt instill such confidence, and any Kando without a customers peace of mind is meaningless.</span>\r\n\r\n<b>LUN NG HNH CNG BN ()</b>\r\n\r\n<span style=\"font-weight: 400;\">Building Ties with Customers for Life</span>\r\n\r\n<span style=\"font-weight: 400;\">We will strive to win the hearts of people around the world, creating value that surpasses expectations.</span>\r\n\r\n<span style=\"font-weight: 400;\">Connect people, societies and the world through our products, racing, CSR activities and harmony with nature</span>');
