INSERT INTO `wp_postmeta` VALUES (32864, 1377, 'short_description', '<span style=\"font-weight: 400;\">KANDO l mt t ting Nht din t cm xc va hi lng va phn khch mnh m khi tri nghim mt iu g  c gi tr vt tri.</span>\r\n\r\n<span style=\"font-weight: 400;\">Bn cnh cc yu s Sng to, Cm xc, S phn khch, Kando cn c cu thnh bi hai yu t l S t tin v Kt ni trong cc sn phm.</span>');
INSERT INTO `wp_postmeta` VALUES (32865, 1377, '_short_description', 'field_611277f24c36b');
INSERT INTO `wp_postmeta` VALUES (32866, 1377, 'content', '<b>GIP BN T TIN ()</b>\r\n\r\n<span style=\"font-weight: 400;\">Cho d mt sn phm c th v hay hp dn n u, nhng nu khng to c s an tm cho khch hng trong qu trnh s dng th u khng c  ngha. Yamaha cam kt mang n s tin cy trong cc sn phm.  l l do v sao mt phn ba s tay ua xe my tham d gii ua a hnh khc nghit nht hnh tinh Paris Dakar Rally nm 1979  chn chic xe XT500 ca Yamaha. XT500 cng chnh l tin thn ca dng xe a hnh ni ting bn b chinh phc mi a hnh Tenere sau ny.</span>\r\n\r\n<i><span style=\"font-weight: 400;\">Tenere 700  mu xe khng nh  tin cy ca Yamaha ti nhng a hnh khc nghit nht th gii</span></i>\r\n\r\n<i><span style=\"font-weight: 400;\"><img class=\"alignnone size-full\" src=\"https://autopro8.mediacdn.vn/2020/6/27/1vmud-15932572141952059873209.jpg\" width=\"800\" height=\"450\" /></span></i>\r\n\r\n<span style=\"font-weight: 400;\">Tm hiu thm v Tenere </span><b>ti y</b><span style=\"font-weight: 400;\">.</span>\r\n\r\n<b>GN KT VI KHCH HNG ()</b>\r\n\r\n<span style=\"font-weight: 400;\">Yamaha khng ch lm lay ng cm xc v tri tm ca khch hng trn ton th gii, vi cc sn phm vt qua s mong i m cn ch trng pht trin ci tr nhn vn. Yamaha n lc kt ni vi tt c cc khch hng, cng ng v x hi thng qua cc sn phm, hot ng ua xe v hot ng trch nghim x hi. Yamaha hin l mt trong nhng n v i u trong vic ng dng cng ngh xanh v sn xut v pht trin bn vng.</span>\r\n\r\n<i><span style=\"font-weight: 400;\">Cc tay ua tr c o to ti Yamaha Racing cho gii bLU cRu</span></i>\r\n\r\n<img class=\"alignnone size-full\" src=\"https://www.yamaha-racing.com/content/dam/racing/news/yz-blu-cru-cup/20190820-the-blu-cru-&amp;-fim-europe-working-together-to-create-a-new-generation-of-champions/ptj8hque7o7vkuxf5oh6.jpg/jcr:content/renditions/cq5dam.web.2000.2000.jpeg\" width=\"1280\" height=\"851\" />\r\n\r\n<i><span style=\"font-weight: 400;\">Yamaha Riding Academy  chng trnh o to li xe  khp th gii ca Yamaha</span></i>\r\n\r\n<img class=\"alignnone size-full\" src=\"https://global.yamaha-motor.com/about/csr/stakeholder/customers/riding-safety-promotion/img/yra002.jpg\" width=\"630\" height=\"221\" />');
