INSERT INTO `wp_postmeta` VALUES (32898, 1380, 'short_description', '<span style=\"font-weight: 400;\">YA-1 l mu xe u tin ca Yamaha v cng chnh l chic xe  to nn cn st ti Nht Bn khi ra mt nm 1955.</span>');
INSERT INTO `wp_postmeta` VALUES (32899, 1380, '_short_description', 'field_611277f24c36b');
INSERT INTO `wp_postmeta` VALUES (32900, 1380, 'content', '&nbsp;\r\n\r\n<img class=\"alignnone size-full\" src=\"https://global.yamaha-motor.com/stories/history/stories/img/0001/pic_002.jpg\" width=\"566\" height=\"353\" />\r\n\r\n<i><span style=\"font-weight: 400;\">i ng k s Yamaha bn cnh chic xe YA-1</span></i>\r\n\r\n<span style=\"font-weight: 400;\">YA-1 l thnh qu ca n lc nghin cu khng bit mt mi ca i ng k s Yamaha lin tc trong vng 8 thng t lc cha c kinh nghim sn xut. YA-1  phi tri qua nhng cuc th nghim v cng khc nghit khi c chnh thc ra mt th trng vo thng 2 nm 1955.</span>\r\n\r\n<img class=\"alignnone size-full\" src=\"https://global.yamaha-motor.com/stories/history/stories/img/0001/pic_003.jpg\" width=\"566\" height=\"353\" />\r\n\r\n<i><span style=\"font-weight: 400;\">YA-1 hon thnh bi kim tra  bn 10,000 km</span></i>\r\n\r\n<b>CHT LNG VT TRI</b>\r\n\r\n<span style=\"font-weight: 400;\">Da trn nguyn mu chic xe DKW 125cc, v ch tch u tin ca Yamaha Motor, ngi Genichi Kawakami,  ch th i ng nghin cu sao cho YA-1 phi mang cht lng cao nht, ng thi cng phi mang nhng gi tr ph hp vi Nht Bn.</span>\r\n\r\n<i><span style=\"font-weight: 400;\">Chic xe YA-1 ti bo tng Yamaha thuc thnh ph Iwata (Nht Bn).</span></i>\r\n\r\n<span style=\"font-weight: 400;\">C th, YA-1 c ng c gn ging vi RT125 nhng c trang b hp s 4 cp thay cho 3 cp trn nguyn mu. y cng l ci tin c bit gip khai thc ti a sc mnh m ng c xe mang li. B phn cn p khi ng cng c Yamaha t ng trc vi cn s, gip vic khi ng xe d dng hn hn.</span>\r\n\r\n<span style=\"font-weight: 400;\">YA-1 s dng ng c 2 th, xi-lanh n, dung tch 125 phn khi v c lm mt bng khng kh. YA-1 c cng sut cc i 5,6 m lc ti vng tua 5.000 vng/pht, m-men xon cc i 9,4 Nm ti 3.300 vng/pht. Tuy ch mang khung sn ng thp n nhng YA-1 c ch to  c th chinh phc mi a hnh khc nghit.</span>\r\n\r\n<span style=\"font-weight: 400;\">i ng thit k cn kt hp vi trng i hc M thut v m nhc Quc gia Tokyo  nghin cu v mu sc cho YA-1. Xe c sn hai tng mu  ht d v trng ng, khin chic xe hon ton ni bt so vi nhng chic xe ch mang mt mu ti thi .</span>\r\n\r\n<img class=\"alignnone size-full\" src=\"https://znews-photo.zadn.vn/w660/Uploaded/wyhktpu/2016_09_19/image001_6.jpg\" width=\"573\" height=\"346\" />\r\n\r\n<i><span style=\"font-weight: 400;\">YA-1 ni ting vi bit danh Akatombo - Chun chun  nh ngoi hnh bt mt.</span></i>\r\n\r\n<b>XA TAN NH KIN</b>\r\n\r\n<span style=\"font-weight: 400;\">Trong giai on u sau khi ra mt, YA-1 vp phi nhiu kh khn trong vic tip cn khch hng. Ngi dng lc ny cha tht s tin tng v kh nng ch to ca Yamaha do Yamaha vn xut thn t mt cng ty sn xut nhc c m nhc. Nhiu ngi cn ni a rng xe Yamaha khi chy chc s pht ra m thanh  r mi.</span>\r\n\r\n<span style=\"font-weight: 400;\">Tuy nhin, YA-1  chng minh s vt tri ca mnh v lm chn ng c Nht Bn. Cc tay ua ca Yamaha ln lt ginh chc v ch v 5 hng cao nht ca cuc ua ln nh ni Ph S ln 3 nm 1955, c din ra ch 10 ngy sau khi cng ty thnh lp. Trong cuc ua cao nguyn Asama sau  4 thng, i Yahama li tip tc ginh chin thng vi 3 v tr cao nht.</span>\r\n\r\n<span style=\"font-weight: 400;\">Thnh tch n tng ca mt cng ty ch mi gia nhp th trng  khin Yamaha ni ting khp Nht Bn. Doanh s YA-1 lin tc tng theo cp s nhn trong vng 3 nm vi hn 11.000 chic YA-1 c bn ra.</span>\r\n\r\n<i><span style=\"font-weight: 400;\">i ua Yamaha thng ln ti cuc ua leo ni Ph S ln 3 nm 1955.</span></i>\r\n\r\n<img class=\"alignnone size-full\" src=\"https://global.yamaha-motor.com/stories/history/stories/img/0002/pic_002.jpg\" width=\"566\" height=\"353\" />\r\n\r\n<span style=\"font-weight: 400;\">Thnh cng ny to tin  cho Yamaha Motor pht trin trong nhng nm tip theo. Hn 60 nm qua k t ngy ra mt mu xe u tin YA-1, Yamaha Motor  khng ngng n lc phn u nhm mang li nhng sn phm tuyt ho v gi tr vt tri tha mn s mong i ca khch hng.</span>');
