INSERT INTO `wp_postmeta` VALUES (32916, 1382, '_short_description', 'field_611277f24c36b');
INSERT INTO `wp_postmeta` VALUES (32917, 1382, 'content', '<span style=\"font-weight: 400;\">Nm 1887, ng Torakusu Yamaha thnh lp Cng ty Nippon Gakki chuyn sn xut n piano - tin thn ca Tp on Yahama ngy nay.</span>\r\n\r\n<span style=\"font-weight: 400;\">Mt nm sau, ng quyt nh s dng hnh nh mt ch chim phng hong ngm m thoa lm biu tng ca cng ty.</span>\r\n\r\n<i><span style=\"font-weight: 400;\">Logo u tin ca tp on Yamaha</span></i>\r\n\r\n<img class=\"alignnone size-full\" src=\"https://i.pinimg.com/originals/27/10/04/2710042f0dc32339f8e0763123bcfe8a.png\" width=\"320\" height=\"320\" />\r\n\r\n<span style=\"font-weight: 400;\">Trong , chic m thoa th hin tr tu v n lc chinh phc cc thch thc ca ng Torakusu trong qu trnh ch tc thnh cng chic n organ u tin ca Nht Bn. Chim phng hong, hay c gi trong l Ho-oh, l loi vt linh thing gi ln sc sng mnh lit, ng nh s mnh mang n cho i nhng m thanh v bn nhc trong tro nht ca Nippon Gakki trong mi sn phm. Mi chic n cng ty sn xut s lm lay ng cm xc v tm hn ca ngi s dng.</span>\r\n\r\n<span style=\"font-weight: 400;\">iu c bit l Torakusu Yamaha ch gn logo ny ln nhng chic n c cht lng cao nht v  hon thin t m nht, th hin mong mun v ng thi l cam kt v vic to ra sn phm ng cp quc t ca ng v c cng ty.</span>\r\n\r\n<span style=\"font-weight: 400;\">Qua cc giai on pht trin, mu logo ny  c thay th v dn hon thin thnh logo ba m thoa an xen nh hin nay. Tuy nhin, cng ty Yamaha Motor vn lun k tha tinh thn cam kt v cc sn phm cc cht lng cao nht, cng nh s mnh lm lay ng cm xc v tm hn ca ngi s dng trong mi sn phm.</span>\r\n\r\n<span style=\"font-weight: 400;\">Tm hiu thm v  ngha logo ca Yamaha ngy nay </span><b>ti y</b><span style=\"font-weight: 400;\">.</span>');
