INSERT INTO `wp_postmeta` VALUES (32935, 1384, 'short_description', '<span style=\"font-weight: 400;\">Genichi Kawakami l v ch tch u tin ca Yamaha Motor. Nu khng c ng th lch s ngnh xe gn my c l s khng c nhng sn phm ni ting nh MT-09 hay Xmax hin nay.</span>');
INSERT INTO `wp_postmeta` VALUES (32936, 1384, '_short_description', 'field_611277f24c36b');
INSERT INTO `wp_postmeta` VALUES (32937, 1384, 'content', '<b>TM NHN VT THI I</b>\r\n\r\n<span style=\"font-weight: 400;\"> tui 38, Genichi Kawakami tr thnh v ch tch th 4 ca Nippon Gakki (tin thn tp on Yamaha ngy nay) v l v ch tch tr tui nht lch s cng ty. Ngay c khi Nippon Gakki ang l mt trong nhng cng ty hng u Nht Bn v nhc c m nhc, ng vn mun m rng nh hng pht trin.</span>\r\n\r\n<span style=\"font-weight: 400;\">ng sm nhn thy nhu cu ca ngi dn vi xe my v quyt nh s tin hnh s dn thn vo lnh vc ny. y l quyt nh mang tnh lch s bi khi y th trng  c hn 150 nh sn xut xe my ln nh cnh tranh gay gt trong khi Nippon Gakki li cha h c kinh nghim.</span>\r\n\r\n<img class=\"alignnone size-full\" src=\"https://www.carpointnews.com.br/wp-content/uploads/2021/07/Yamaha-Genichi-Kawakami.jpg\" width=\"1268\" height=\"625\" />\r\n\r\n<i><span style=\"font-weight: 400;\">\"Ti mun chng ta th ch to ng c xe gn my\" - cu ni huyn thoi ca Ch tch Genichi Kawakami m u cho lch s hnh thnh Yamaha Motor.</span></i>\r\n\r\n<span style=\"font-weight: 400;\">Ngoi vic c i ng k s i chu u hc hi kinh nghim, ng cng ch thn kho st ti nhng th trng nh M v chu u, cng nh trc tip tham gia v cng vic lp rp v th nghim cc phin bn nguyn mu.</span>\r\n\r\n<b>MU XE U TIN RA I</b>\r\n\r\n<span style=\"font-weight: 400;\">Sau hn 8 thng t lc ra quyt nh, chic xe nguyn mu u tin ca Yamaha  ra i. Mang tn YA-1, chic xe c ly cm hng t mu xe DKW RT125 rt ph bin  chu u. Vi thit k p mt, m cht th thao, mu sc mi l l  ht d, trng ng voi cng cng ngh sn cao cp tha hng t b phn sn xut n piano, YA-1 ni bt hn hn so vi nhng chic xe a phn ch mang mu ti thi .</span>\r\n\r\n<img class=\"alignnone size-full wp-image-1385\" src=\"https://yamaha-dev.demo-web.asia/wp/wp-content/uploads/2021/11/YA-1-e1524020016691.jpeg\" alt=\"\" width=\"2000\" height=\"1100\" />\r\n\r\n<i><span style=\"font-weight: 400;\">Chic xe u tin ca Yamaha - YA-1 v cng tinh t v ni bt.</span></i>\r\n\r\n<span style=\"font-weight: 400;\">YA-1 khng nhng p m cn rt th thao. Chic xe nhanh chng chng t c s vt tri ca mnh khi lin tip v ch Cuc ua leo ni Ph S v Cuc ua a hnh Asama cc nm 1955 v 1957. YA-1 nhanh chng c ngi dn Nht Bn n nhn.</span>\r\n\r\n<img class=\"alignnone size-full\" src=\"https://cartimes.vn/images/18/2/28/lich-su-ra-doi-cua-xe-may-yamaha.jpg\" width=\"996\" height=\"560\" />\r\n\r\n<span style=\"font-weight: 400;\">Ngy 1 thng 7 nm 1955, b phin nghin cu ng c ca Nippon Gakki c tch ra v chnh thc thnh lp cng ty Yamaha Motor, vi Genichi Kawakami l v ch tch u tin. Tm nhn ca Genichi Kawakami  khai sinh Yamaha Motor, v thay i hon ton lch s. Tri qua hn 60 nm hnh thnh v pht trin mnh m., Yamaha Motor  tr thnh mt trong nhng cng ty ln nht th gii v sn xut xe gn my v ng c. </span>');
