INSERT INTO `wp_postmeta` VALUES (35002, 1486, 'content', '<span style=\"font-weight: 400;\">Tt c cc loi xe m t Yamaha mi do Revzone Yamaha Motor kinh doanh u c ng k bo hnh v cp s bo hnh  hng dch v bo hnh (iu chnh hay thay th min ph bt k chi tit no b h hng do li ca nh sn xut  khng bao gm nhng iu ngoi phm vi bo hnh nu  mc di y) trong thi gian quy nh. Thi hn bo hnh l hai (2) nm hay 30.000km u tin, ty theo iu kin no n trc (*).</span>\r\n\r\n<img class=\"size-full wp-image-414 aligncenter\" src=\"https://yamaha-dev.demo-web.asia/wp/wp-content/uploads/2021/10/Rectangle-321-1.jpg\" alt=\"\" width=\"2184\" height=\"1080\" />\r\n\r\n<b>S bo hnh</b>\r\n\r\n<span style=\"font-weight: 400;\">S bo hnh l cn c  khch hng s dng quyn li v dch v sau bn hng i vi chic xe ca mnh: Dch v bo hnh. / Dch v bo dng nh k min ph. / Cc chng trnh khuyn mi, chm sc khch hng,   m bo cc khch hng c th s dng quyn li dch v trn ti bt c trm dch v u quyn no ca Yamaha trn ton quc, khi giao xe Yamaha mi cho khch, cc i l y quyn ca Yamaha phi ng k v cp s bo hnh tht do Revzone Yamaha Motor cp km theo xe.</span>\r\n\r\n<img class=\"alignnone size-full\" src=\"https://yamaha-motor.com.vn/wp/wp-content/webp-express/webp-images/doc-root/wp/wp-content/themes/yamaha/assets/img/service-subpage/img01-1.jpg.webp\" width=\"716\" height=\"470\" />\r\n\r\n<span style=\"font-weight: 400;\">Lu  : Nu khch hng khng nhn c s bo hnh c  cc phiu bo dng nh k min ph hoc s bo hnh khng phi do Yamaha cung cp km theo xe (tham kho mu s bo hnh v cc phiu bo dng min ph  phn sau) th khch hng s b mt quyn s dng cc dch v Bo hnh v bo dng nh k min ph. V quyn li chnh ng ca mnh, mi khch hng hy cng vi Revzone Yamaha Motor bo v quyn li ca ngi tiu dng bng cch ch ng yu cu i l bn xe ng k v cung cp s bo hnh tht.</span>\r\n\r\n<span style=\"font-weight: 400;\">S bo hnh ch c cp mt ln duy nht.</span>\r\n\r\n&nbsp;');
