INSERT INTO `wp_postmeta` VALUES (35011, 1488, '_content', 'field_6194c1a061d0e');
INSERT INTO `wp_postmeta` VALUES (35012, 1458, 'content', '<span style=\"font-weight: 400;\">ZUTTORIDE  DCH V CU H CHUYN NGHIP</span>\r\n\r\n<span style=\"font-weight: 400;\">ZuttoRide Vit Nam c thnh lp t nm 2012. Trong thi gian u gp rt nhiu kh khn v y l mt dch v hon ton mi ti Vit Nam, nhng vi s am m v tin tng vo th trng ZuttoRide Vit Nam  c gng phn u tng ngy, tng gi gip ngi dn Vit Nam bit n dch v mi v y hu ch ny.</span>\r\n\r\n<img class=\"size-full wp-image-416 aligncenter\" src=\"https://yamaha-dev.demo-web.asia/wp/wp-content/uploads/2021/10/Rectangle-321-2.jpg\" alt=\"\" width=\"1092\" height=\"540\" />\r\n\r\n<span style=\"font-weight: 400;\">Tnh n thi im hin ti ZuttoRide Vit Nam  ph khp cc tnh thnh trn c nc, vi i ng trn 300 nhn vin cu h v trn 100 xe ti cu h phn b u trn c nc. ZuttoRide t tin l cng ty u tin v duy nht c th p ng nhu cu cu h ca ngi s dng xe my v xe moto trn c nc.</span>\r\n\r\n<span style=\"font-weight: 400;\">Cho n nay ZuttoRide Vit Nam  c trn 1.000.000 khch hng t mi tnh thnh trn c nc,  l ngun ng lc gip i ng nhn vin khng ngng ci thin nhm nng cao cht lng phc v cho ngi s dng xe my v xe moto ti Vit Nam.</span>\r\n<ul>\r\n 	<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Cu h 24/24</span></li>\r\n 	<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Tng i t vn 24/24</span></li>\r\n 	<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Phc v trn c nc</span></li>\r\n 	<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Nhn vin chuyn nghip</span></li>\r\n 	<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Trang thit b hin i</span></li>\r\n 	<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Tiu chun Nht Bn</span></li>\r\n</ul>\r\n<span style=\"font-weight: 400;\">Lin h ngay  c h tr 24/7: 1800 1588</span>');
INSERT INTO `wp_postmeta` VALUES (35013, 1458, '_content', 'field_6194c32d12110');
