INSERT INTO `wp_posts` VALUES (965, 1, '2021-10-09 05:10:06', '2021-10-09 05:10:06', '<!-- wp:paragraph -->\n<p> <strong>V CNG TY TNHH YAMAHA MOTOR VIT NAM</strong> </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Cng ty TNHH Yamaha Motor Vit Nam c thnh lp vo ngy 24 thng nm 1998 vi vn iu l 37 triu USD qua doanh gia Vit Nam, Nht Bn, v Malaysia. Cng ty c tr s chnh ti x Trung Gi, huyn Sc Sn, H Ni.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":952,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://yamaha-dev.demo-web.asia/wp/wp-content/uploads/2021/10/yamaha-factory-1-1024x686.jpg\" alt=\"\" class=\"wp-image-952\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p> Yamaha Motor Vit Nam (YMVN) chuyn sn xut v lp rp xe my nhn hiu Yamaha, linh kin, ph tng xe my v cung cp dch v bo hnh sa cha xe my. Qua hn 20 nm pht trin, h thng i l ca Yamaha Motor Vit Nam  t n con s hn 300 i l, ca hng trn khp Vit Nam. H thng tiu chun cng nh hnh nh ca i l, ca hng, phng trng by cng lin tc c nng cp. Hin cng ty ang vn hnh hai nh my vi din tch hn 100,000 m<sup>2</sup> vi i ng hn 6500 nhn vin. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p> <img width=\"512\" height=\"294.4009552001953\" alt=\"Tin tc\" src=\"https://lh6.googleusercontent.com/fDIc5SuTm6bpMou5tUvsuNZkM7nXA_Dox0yU_rtv80L4kywaixMMtp5AdUXXFAx_JlMip6c22u9QnKeAfmJ2N_3VRl5nLyUw26QHG_xtPz9bjUxdn1Q_YJFCAtVgJe8lF18XIMg=s0\"> </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p> Vi phng chm TR THNH CNG TY TO RA KANDO, Yamaha Motor Vit Nam khng ngng n lc nhm hin thc ha gic m ca mi khch hng vi nim am m v kht khao sng to, lun i tin phong mang li nhng sn phm tuyt ho v gi tr vt tri tha mn s mong i ca khch hng. Vi khu hiu Khi dy am m, to ra nhng gi tr v tri nghim vt tri, lm phong ph cuc sng cho mi khch hng, Yamaha Motor Vit Nam phn u tr thnh mt thnh vin tch cc ca cng ng Vit Nam, nhanh chng gp phn vo s pht trin ca ngnh cng nghip Vit Nam trong lnh vc sn xut xe gn my.</p>\n<!-- /wp:paragraph -->', 'Yamaha Motor Vit Nam', '', 'publish', 'open', 'open', '', 'yamaha-motor-viet-nam', '', '', '2021-10-09 05:10:06', '2021-10-09 05:10:06', '', 0, 'https://yamaha-dev.demo-web.asia/wp/?p=965', 0, 'post', '', 0);
INSERT INTO `wp_posts` VALUES (967, 1, '2021-10-09 05:10:06', '2021-10-09 05:10:06', '<!-- wp:paragraph -->\n<p> <strong>V CNG TY TNHH YAMAHA MOTOR VIT NAM</strong> </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Cng ty TNHH Yamaha Motor Vit Nam c thnh lp vo ngy 24 thng nm 1998 vi vn iu l 37 triu USD qua doanh gia Vit Nam, Nht Bn, v Malaysia. Cng ty c tr s chnh ti x Trung Gi, huyn Sc Sn, H Ni.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":952,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://yamaha-dev.demo-web.asia/wp/wp-content/uploads/2021/10/yamaha-factory-1-1024x686.jpg\" alt=\"\" class=\"wp-image-952\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p> Yamaha Motor Vit Nam (YMVN) chuyn sn xut v lp rp xe my nhn hiu Yamaha, linh kin, ph tng xe my v cung cp dch v bo hnh sa cha xe my. Qua hn 20 nm pht trin, h thng i l ca Yamaha Motor Vit Nam  t n con s hn 300 i l, ca hng trn khp Vit Nam. H thng tiu chun cng nh hnh nh ca i l, ca hng, phng trng by cng lin tc c nng cp. Hin cng ty ang vn hnh hai nh my vi din tch hn 100,000 m<sup>2</sup> vi i ng hn 6500 nhn vin. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p> <img width=\"512\" height=\"294.4009552001953\" alt=\"Tin tc\" src=\"https://lh6.googleusercontent.com/fDIc5SuTm6bpMou5tUvsuNZkM7nXA_Dox0yU_rtv80L4kywaixMMtp5AdUXXFAx_JlMip6c22u9QnKeAfmJ2N_3VRl5nLyUw26QHG_xtPz9bjUxdn1Q_YJFCAtVgJe8lF18XIMg=s0\"> </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p> Vi phng chm TR THNH CNG TY TO RA KANDO, Yamaha Motor Vit Nam khng ngng n lc nhm hin thc ha gic m ca mi khch hng vi nim am m v kht khao sng to, lun i tin phong mang li nhng sn phm tuyt ho v gi tr vt tri tha mn s mong i ca khch hng. Vi khu hiu Khi dy am m, to ra nhng gi tr v tri nghim vt tri, lm phong ph cuc sng cho mi khch hng, Yamaha Motor Vit Nam phn u tr thnh mt thnh vin tch cc ca cng ng Vit Nam, nhanh chng gp phn vo s pht trin ca ngnh cng nghip Vit Nam trong lnh vc sn xut xe gn my.</p>\n<!-- /wp:paragraph -->', 'Yamaha Motor Vit Nam', '', 'inherit', 'closed', 'closed', '', '965-revision-v1', '', '', '2021-10-09 05:10:06', '2021-10-09 05:10:06', '', 965, 'https://yamaha-dev.demo-web.asia/wp/?p=967', 0, 'revision', '', 0);
